INSERT INTO ROUTINES VALUES
('get_division', 'def', 'hrlhep', 'get_division', 'FUNCTION', 'varchar', 1000, 3000, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'varchar(1000)', 'SQL', 'BEGIN\r\n  DECLARE cur_id int;\r\n  DECLARE orig_id int;\r\n  DECLARE ids int;\r\n  DECLARE id1 int;\r\n  DECLARE id2 int;\r\n  DECLARE id3 int;\r\n  DECLARE id4 int;\r\n  DECLARE id5 int;\r\n  DECLARE id6 int;\r\n  DECLARE id7 int;\r\n  DECLARE nn int;\r\n  DECLARE idtt int;\r\n\r\n  DECLARE orig_n varchar(255);\r\n  DECLARE n varchar(255);\r\n  DECLARE n1 varchar(255);\r\n  DECLARE n2 varchar(255);\r\n  DECLARE n3 varchar(255);\r\n  DECLARE n4 varchar(255);\r\n  DECLARE n5 varchar(255);\r\n  DECLARE n6 varchar(255);\r\n  DECLARE n7 varchar(255);\r\n\r\n  DECLARE res varchar(1255);\r\n  DECLARE cur_pid int;\r\n  DECLARE done int DEFAULT FALSE;\r\n  DECLARE div1 CURSOR FOR\r\n  SELECT\r\n    id,\r\n    pid,\r\n    short_name\r\n  FROM struktura\r\n  WHERE id = idtt;\r\n  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;\r\n  SET cur_id = 0;\r\n  SET id1 = 0;\r\n  SET id2 = 0;\r\n  SET id3 = 0;\r\n  SET id4 = 0;\r\n  SET id5 = 0;\r\n  SET id6 = 0;\r\n  SET id7 = 0;\r\n  SET idtt = 0;\r\n  SET n = "";\r\n  SET n1 = "";\r\n  SET n2 = "";\r\n  SET n3 = "";\r\n  SET n4 = "";\r\n  SET n5 = "";\r\n  SET n6 = "";\r\n  SET n7 = "";\r\n  SET cur_pid = 0;\r\n  SET nn = 0;\r\n  SET cur_id = divid;\r\n  SET res = "";\r\n\r\n  SET nn = nn + 1;\r\n  SET idtt = divid;\r\n  OPEN div1;\r\n  FETCH div1 INTO cur_id, cur_pid, n;\r\n  CLOSE div1;\r\n  SET id1 = cur_id;\r\n  SET n1 = n;\r\n  SET orig_id = cur_id;\r\n  SET orig_n = n;\r\n\r\n  WHILE NOT done DO\r\n    SET nn = nn + 1;\r\n    SET res = CONCAT(res, nn, " nid:", idtt, " done:", done, " Name:''", n, "'' PID:", cur_pid, " ->ID:", cur_id, " # ");\r\n    IF cur_pid = -1 THEN\r\n      SET res = CONCAT(res, " FIN :", nn, " done:", done, " ", n, ": PID:", cur_pid, " ->ID:", cur_id, "  # ");\r\n      IF level = 0 THEN\r\n        SET res = CONCAT(n, " ", cur_id);\r\n        RETURN res;\r\n      END IF;\r\n      IF level = 1 THEN\r\n        SET res = CONCAT(n1, " ", id1);\r\n        RETURN res;\r\n      END IF;\r\n      IF level = 2 THEN\r\n        SET res = CONCAT(n2, " ", id2);\r\n        RETURN res;\r\n      END IF;\r\n      IF level = 3 THEN\r\n        SET res = CONCAT(n3, " ", id3);\r\n        RETURN res;\r\n      END IF;\r\n      SET res = CONCAT(orig_n, " ", orig_id);\r\n      RETURN res;\r\n    END IF;\r\n    IF LENGTH(res) > 800 THEN\r\n      SET res = CONCAT(res, "too long!!! ");\r\n      RETURN res;\r\n    END IF;\r\n\r\n    SET id3 = id2;\r\n    SET id2 = id1;\r\n    SET id1 = cur_id;\r\n    SET n3 = n2;\r\n    SET n2 = n1;\r\n    SET n1 = n;\r\n    SET idtt = cur_pid;\r\n    OPEN div1;\r\n    FETCH div1 INTO cur_id, cur_pid, n;\r\n    CLOSE div1;\r\n  END WHILE;\r\n  SET nn = nn + 1;\r\n  SET res = CONCAT(res, " FIN :", nn, " done:", done, " ", n, ": PID:", cur_pid, " ->ID:", cur_id, "  # ");\r\n  IF level = 1 THEN\r\n    SET res = CONCAT(n1, " ", id1);\r\n    RETURN res;\r\n  END IF;\r\n  IF level = 2 THEN\r\n    SET res = CONCAT(n2, " ", id2);\r\n    RETURN res;\r\n  END IF;\r\n  IF level = 3 THEN\r\n    SET res = CONCAT(n3, " ", id3);\r\n    RETURN res;\r\n  END IF;\r\n  SET res = CONCAT(orig_n, " ", orig_id);\r\n  RETURN res;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2018-02-06 15:30:05', '2018-02-06 15:30:05', 'NO_AUTO_VALUE_ON_ZERO', 'Возвращает для сотрудника отделение или отделение, отдел, ', 'hrlhep@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('get_Otdel', 'def', 'hrlhep', 'get_Otdel', 'FUNCTION', 'varchar', 100, 300, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'varchar(100)', 'SQL', 'BEGIN\r\n  DECLARE cur_id int;\r\n  DECLARE id1 int;\r\n  DECLARE id2 int;\r\n  DECLARE id3 int;\r\n  DECLARE n varchar(255);\r\n  DECLARE n1 varchar(255);\r\n  DECLARE n2 varchar(255);\r\n  DECLARE n3 varchar(255);\r\n  DECLARE res varchar(255);\r\n  DECLARE cur_pid int;\r\n  #\tdeclare done int default false;\r\n  #\tDECLARE div1 CURSOR FOR SELECT  pid, short_name   from info_10 ;\r\n  #\tDECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;\r\n  SET cur_id = 0;\r\n  SET id1 = id;\r\n  SET id2 = 0;\r\n  SET id3 = 0;\r\n  SET n = "";\r\n  SET n1 = "";\r\n  SET n2 = "";\r\n  SET n3 = "";\r\n  SET cur_pid = 0;\r\n\r\n  SET cur_id = divid;\r\n  SET res = "";\r\n  SET res = CONCAT("##   start ", cur_pid, " ->", cur_id, " , ", res);\r\n  #\topen div1;\r\n\r\n  #\tfetch div1 into cur_pid,  n;\r\n  SET res = CONCAT("#   start ", n, ": ", cur_pid, " ->", cur_id, " , ", res);\r\n  #   while not done do \r\n  SET res = CONCAT(cur_pid, " ->", cur_id, " , ", res);\r\n  IF pid = 100000 THEN\r\n    RETURN CONCAT("Parent:", n, " P1:", n1, " p2:", n2, " p3:", n3);\r\n  END IF;\r\n  SET id1 = cur_id;\r\n  SET id2 = id1;\r\n  SET id3 = id2;\r\n  SET n1 = n;\r\n  SET n2 = n1;\r\n  SET n3 = n2;\r\n  SET cur_id = cur_pid;\r\n  #\t\tfetch div1 into cur_pid,  n;\r\n  #\tend while;\r\n  #\tclose div1;\r\n  RETURN res;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2018-02-06 15:30:05', '2018-02-06 15:30:05', 'NO_AUTO_VALUE_ON_ZERO', '', 'hrlhep@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('SetAllProjectsToAdmins', 'def', 'hrlhep', 'SetAllProjectsToAdmins', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n  INSERT user_rights (topic_id, project_id, person_id, adm, `write`, project_name)\r\n    SELECT\r\n      p.Topic_id,\r\n      p.ID,\r\n      ur.kod_fl,\r\n      1,\r\n      1,\r\n      p.short_name\r\n    FROM users ur\r\n      JOIN projects p\r\n    WHERE ur.right_level > 30;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2018-02-06 15:30:05', '2018-02-06 15:30:05', 'NO_AUTO_VALUE_ON_ZERO', '', 'hrlhep@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('setNodesLevel', 'def', 'hrlhep', 'setNodesLevel', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\n  DECLARE done int;\r\n  DECLARE nextId int;\r\n  DECLARE nextPid int;\r\n  DECLARE lev int;\r\n  -- DECLARE sql varchar(255);\r\n\r\n  -- SET @sql = concat(''select id from '', table_name, '' where level is null'');\r\n  DECLARE cur1 CURSOR FOR\r\n  SELECT\r\n    `id`\r\n  FROM info_10\r\n  WHERE `level` IS NULL;\r\n  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;\r\n  SET done = 0;\r\n\r\n  OPEN cur1;\r\n  FETCH cur1 INTO nextId;\r\n  IF NOT done THEN\r\n    REPEAT\r\n      SELECT\r\n        pid INTO nextPid\r\n      FROM info_10\r\n      WHERE id = nextId;\r\n      SELECT\r\n        level + 1 INTO lev\r\n      FROM info_10\r\n      WHERE id = nextPid;\r\n      UPDATE info_10\r\n      SET level = lev\r\n      WHERE id = nextId;\r\n      FETCH cur1 INTO nextId;\r\n    UNTIL done END REPEAT;\r\n  END IF;\r\n\r\n  CLOSE cur1;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2018-02-06 15:30:05', '2018-02-06 15:30:05', 'NO_AUTO_VALUE_ON_ZERO', '', 'hrlhep@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('Update_Parent_top_sub', 'def', 'hrlhep', 'Update_Parent_top_sub', 'FUNCTION', 'varchar', 1200, 3600, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'varchar(1200)', 'SQL', 'BEGIN\r\n  DECLARE cur_id int;\r\n  DECLARE id1 int;\r\n  DECLARE id2 int;\r\n  DECLARE id3 int;\r\n  DECLARE nn int;\r\n  DECLARE idtt int;\r\n\r\n  DECLARE n varchar(255);\r\n  DECLARE n1 varchar(255);\r\n  DECLARE n2 varchar(255);\r\n  DECLARE n3 varchar(255);\r\n  DECLARE res varchar(1255);\r\n  DECLARE cur_pid int;\r\n  DECLARE done int DEFAULT FALSE;\r\n  DECLARE div1 CURSOR FOR\r\n  SELECT\r\n    id,\r\n    pid,\r\n    short_name\r\n  FROM info_10\r\n  WHERE id = idtt;\r\n  DECLARE sotr CURSOR FOR\r\n  SELECT\r\n    div_code\r\n  FROM sotrudniki\r\n  WHERE tab_n = sotr_Tab_n;\r\n  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;\r\n\r\n  SET cur_id = 0;\r\n  SET id1 = 0;\r\n  SET id2 = 0;\r\n  SET id3 = 0;\r\n  SET idtt = 0;\r\n  SET n = "";\r\n  SET n1 = "";\r\n  SET n2 = "";\r\n  SET n3 = "";\r\n  SET cur_pid = -10;\r\n  SET nn = 0;\r\n  SET res = "-";\r\n  OPEN sotr;\r\n  FETCH sotr INTO idtt;\r\n  CLOSE sotr;\r\n  IF done THEN\r\n    RETURN res;\r\n  END IF;\r\n  SET cur_id = -10;\r\n  SET nn = nn + 1;\r\n  SET done = FALSE;\r\n  OPEN div1;\r\n  FETCH div1 INTO cur_id, cur_pid, n;\r\n  CLOSE div1;\r\n  SET nn = nn + 1;\r\n  SET done = FALSE;\r\n  SET res = CONCAT(">> nid:", idtt, " done:", done, " Name:''", n, "'' PID:", cur_pid, " ->ID:", cur_id, "  # ");\r\n\r\n  WHILE NOT done DO\r\n    SET nn = nn + 1;\r\n    SET res = CONCAT(res, nn, " nid:", idtt, " done:", done, " Name:''", n, "'' PID:", cur_pid, " ->ID:", cur_id, "  # ");\r\n    IF cur_pid = 2 THEN\r\n      UPDATE sotrudniki\r\n      SET lab_id = cur_id,\r\n          TopParent_name = n1,\r\n          SubTopParent_name = n2,\r\n          TopParent_code = id1,\r\n          SubTopParent_code = id2\r\n      WHERE tab_n = sotr_tab_n;\r\n      RETURN CONCAT("Parent:", cur_id, ", ", n, " P1:", id1, ", ", n1, " p2:", id2, ", ", n2, " p3:", id3, ", ", n3);\r\n\r\n    END IF;\r\n    IF LENGTH(res) > 1000 THEN\r\n      SET res = CONCAT(res, "too long!!! ");\r\n      RETURN res;\r\n    END IF;\r\n    SET id3 = id2;\r\n    SET id2 = id1;\r\n    SET id1 = cur_id;\r\n    SET n3 = n2;\r\n    SET n2 = n1;\r\n    SET n1 = n;\r\n    SET idtt = cur_pid;\r\n    OPEN div1;\r\n    FETCH div1 INTO cur_id, cur_pid, n;\r\n    CLOSE div1;\r\n  END WHILE;\r\n\r\n  SET nn = nn + 1;\r\n  SET res = CONCAT(res, " FIN :", nn, " done:", done, " ", n, ": PID:", cur_pid, " ->ID:", cur_id, "  # ");\r\n  RETURN res;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2018-02-06 15:30:05', '2018-02-06 15:30:05', 'NO_AUTO_VALUE_ON_ZERO', 'Обновляет поля TopParent и subTopParent (отделение и отдел/сектор) сотрудника (только для лабораторий)', 'hrlhep@%', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('create_synonym_db', 'def', 'sys', 'create_synonym_db', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN DECLARE v_done bool DEFAULT FALSE; DECLARE v_db_name_check VARCHAR(64); DECLARE v_db_err_msg TEXT; DECLARE v_table VARCHAR(64); DECLARE v_views_created INT DEFAULT 0;  DECLARE db_doesnt_exist CONDITION FOR SQLSTATE ''42000''; DECLARE db_name_exists CONDITION FOR SQLSTATE ''HY000'';  DECLARE c_table_names CURSOR FOR  SELECT TABLE_NAME  FROM INFORMATION_SCHEMA.TABLES  WHERE TABLE_SCHEMA = in_db_name;  DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;  SELECT SCHEMA_NAME INTO v_db_name_check FROM INFORMATION_SCHEMA.SCHEMATA WHERE SCHEMA_NAME = in_db_name;  IF v_db_name_check IS NULL THEN SET v_db_err_msg = CONCAT(''Unknown database '', in_db_name); SIGNAL SQLSTATE ''HY000'' SET MESSAGE_TEXT = v_db_err_msg; END IF;  SELECT SCHEMA_NAME INTO v_db_name_check FROM INFORMATION_SCHEMA.SCHEMATA WHERE SCHEMA_NAME = in_synonym;  IF v_db_name_check = in_synonym THEN SET v_db_err_msg = CONCAT(''Can''t create database '', in_synonym, ''; database exists''); SIGNAL SQLSTATE ''HY000'' SET MESSAGE_TEXT = v_db_err_msg; END IF;  SET @create_db_stmt := CONCAT(''CREATE DATABASE '', sys.quote_identifier(in_synonym)); PREPARE create_db_stmt FROM @create_db_stmt; EXECUTE create_db_stmt; DEALLOCATE PREPARE create_db_stmt;  SET v_done = FALSE; OPEN c_table_names; c_table_names: LOOP FETCH c_table_names INTO v_table; IF v_done THEN LEAVE c_table_names; END IF;  SET @create_view_stmt = CONCAT( ''CREATE SQL SECURITY INVOKER VIEW '', sys.quote_identifier(in_synonym), ''.'', sys.quote_identifier(v_table), '' AS SELECT * FROM '', sys.quote_identifier(in_db_name), ''.'', sys.quote_identifier(v_table) ); PREPARE create_view_stmt FROM @create_view_stmt; EXECUTE create_view_stmt; DEALLOCATE PREPARE create_view_stmt;  SET v_views_created = v_views_created + 1; END LOOP; CLOSE c_table_names;  SELECT CONCAT( ''Created '', v_views_created, '' view'', IF(v_views_created != 1, ''s'', ''''), '' in the '', sys.quote_identifier(in_synonym), '' database'' ) AS summary;  END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Takes a source database name and synonym name, and then creates the \n synonym database with views that point to all of the tables within\n the source database.\n \n Useful for creating a "ps" synonym for "performance_schema",\n or "is" instead of "information_schema", for example.\n \n Parameters\n \n in_db_name (VARCHAR(64)):\n The database name that you would like to create a synonym for.\n in_synonym (VARCHAR(64)):\n The database synonym name.\n \n Example\n \n mysql> SHOW DATABASES;\n +--------------------+\n | Database           |\n +--------------------+\n | information_schema |\n | mysql              |\n | performance_schema |\n | sys                |\n | test               |\n +--------------------+\n 5 rows in set (0.00 sec)\n \n mysql> CALL sys.create_synonym_db(''performance_schema'', ''ps'');\n +---------------------------------------+\n | summary                               |\n +---------------------------------------+\n | Created 74 views in the `ps` database |\n +---------------------------------------+\n 1 row in set (8.57 sec)\n \n Query OK, 0 rows affected (8.57 sec)\n \n mysql> SHOW DATABASES;\n +--------------------+\n | Database           |\n +--------------------+\n | information_schema |\n | mysql              |\n | performance_schema |\n | ps                 |\n | sys                |\n | test               |\n +--------------------+\n 6 rows in set (0.00 sec)\n \n mysql> SHOW FULL TABLES FROM ps;\n +------------------------------------------------------+------------+\n | Tables_in_ps                                         | Table_type |\n +------------------------------------------------------+------------+\n | accounts                                             | VIEW       |\n | cond_instances                                       | VIEW       |\n | events_stages_current                                | VIEW       |\n | events_stages_history                                | VIEW       |\n ...\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('diagnostics', 'def', 'sys', 'diagnostics', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN DECLARE v_start, v_runtime, v_iter_start, v_sleep DECIMAL(20,2) DEFAULT 0.0; DECLARE v_has_innodb, v_has_ndb, v_has_ps, v_has_replication, v_has_ps_replication VARCHAR(8) CHARSET utf8 DEFAULT ''NO''; DECLARE v_this_thread_enabled, v_has_ps_vars, v_has_metrics ENUM(''YES'', ''NO''); DECLARE v_table_name, v_banner VARCHAR(64) CHARSET utf8; DECLARE v_sql_status_summary_select, v_sql_status_summary_delta, v_sql_status_summary_from, v_no_delta_names TEXT; DECLARE v_output_time, v_output_time_prev DECIMAL(20,3) UNSIGNED; DECLARE v_output_count, v_count, v_old_group_concat_max_len INT UNSIGNED DEFAULT 0; DECLARE v_status_summary_width TINYINT UNSIGNED DEFAULT 50; DECLARE v_done BOOLEAN DEFAULT FALSE; DECLARE c_ndbinfo CURSOR FOR SELECT TABLE_NAME FROM information_schema.TABLES WHERE TABLE_SCHEMA = ''ndbinfo'' AND TABLE_NAME NOT IN ( ''blocks'', ''config_params'', ''dict_obj_types'', ''disk_write_speed_base'', ''memory_per_fragment'', ''memoryusage'', ''operations_per_fragment'', ''threadblocks'' ); DECLARE c_sysviews_w_delta CURSOR FOR SELECT table_name FROM tmp_sys_views_delta ORDER BY table_name;  DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;  SELECT INSTRUMENTED INTO v_this_thread_enabled FROM performance_schema.threads WHERE PROCESSLIST_ID = CONNECTION_ID(); IF (v_this_thread_enabled = ''YES'') THEN CALL sys.ps_setup_disable_thread(CONNECTION_ID()); END IF;  IF (in_max_runtime < in_interval) THEN SIGNAL SQLSTATE ''45000'' SET MESSAGE_TEXT = ''in_max_runtime must be greater than or equal to in_interval''; END IF; IF (in_max_runtime = 0) THEN SIGNAL SQLSTATE ''45000'' SET MESSAGE_TEXT = ''in_max_runtime must be greater than 0''; END IF; IF (in_interval = 0) THEN SIGNAL SQLSTATE ''45000'' SET MESSAGE_TEXT = ''in_interval must be greater than 0''; END IF;  IF (@sys.diagnostics.allow_i_s_tables IS NULL) THEN SET @sys.diagnostics.allow_i_s_tables = sys.sys_get_config(''diagnostics.allow_i_s_tables'', ''OFF''); END IF; IF (@sys.diagnostics.include_raw IS NULL) THEN SET @sys.diagnostics.include_raw      = sys.sys_get_config(''diagnostics.include_raw''     , ''OFF''); END IF; IF (@sys.debug IS NULL) THEN SET @sys.debug                        = sys.sys_get_config(''debug''                       , ''OFF''); END IF; IF (@sys.statement_truncate_len IS NULL) THEN SET @sys.statement_truncate_len       = sys.sys_get_config(''statement_truncate_len''      , ''64'' ); END IF;  SET @log_bin := @@sql_log_bin; IF (@log_bin = 1) THEN SET sql_log_bin = 0; END IF;  SET v_no_delta_names = CONCAT(''s%{COUNT}.Variable_name NOT IN ('', ''''innodb_buffer_pool_pages_total'', '', ''''innodb_page_size'', '', ''''last_query_cost'', '', ''''last_query_partial_plans'', '', ''''qcache_total_blocks'', '', ''''slave_last_heartbeat'', '', ''''ssl_ctx_verify_depth'', '', ''''ssl_ctx_verify_mode'', '', ''''ssl_session_cache_size'', '', ''''ssl_verify_depth'', '', ''''ssl_verify_mode'', '', ''''ssl_version'', '', ''''buffer_flush_lsn_avg_rate'', '', ''''buffer_flush_pct_for_dirty'', '', ''''buffer_flush_pct_for_lsn'', '', ''''buffer_pool_pages_total'', '', ''''lock_row_lock_time_avg'', '', ''''lock_row_lock_time_max'', '', ''''innodb_page_size'''', '')'');  IF (in_auto_config <> ''current'') THEN IF (@sys.debug = ''ON'') THEN SELECT CONCAT(''Updating Performance Schema configuration to '', in_auto_config) AS ''Debug''; END IF; CALL sys.ps_setup_save(0);  IF (in_auto_config = ''medium'') THEN UPDATE performance_schema.setup_consumers SET ENABLED = ''YES'' WHERE NAME NOT LIKE ''%\\_history%'';  UPDATE performance_schema.setup_instruments SET ENABLED = ''YES'', TIMED   = ''YES'' WHERE NAME NOT LIKE ''wait/synch/%''; ELSEIF (in_auto_config = ''full'') THEN UPDATE performance_schema.setup_consumers SET ENABLED = ''YES'';  UPDATE performance_schema.setup_instruments SET ENABLED = ''YES'', TIMED   = ''YES''; END IF;  UPDATE performance_schema.threads SET INSTRUMENTED = ''YES'' WHERE PROCESSLIST_ID <> CONNECTION_ID(); END IF;  SET v_start        = UNIX_TIMESTAMP(NOW(2)), in_interval    = IFNULL(in_interval, 30), in_max_runtime = IFNULL(in_max_runtime, 60);  SET v_banner = REPEAT( ''-'', LEAST( GREATEST( 36, CHAR_LENGTH(VERSION()), CHAR_LENGTH(@@global.version_comment), CHAR_LENGTH(@@global.version_compile_os), CHAR_LENGTH(@@global.version_compile_machine), CHAR_LENGTH(@@global.socket), CHAR_LENGTH(@@global.datadir) ), 64 ) ); SELECT ''Hostname'' AS ''Name'', @@global.hostname AS ''Value'' UNION ALL SELECT ''Port'' AS ''Name'', @@global.port AS ''Value'' UNION ALL SELECT ''Socket'' AS ''Name'', @@global.socket AS ''Value'' UNION ALL SELECT ''Datadir'' AS ''Name'', @@global.datadir AS ''Value'' UNION ALL SELECT ''Server UUID'' AS ''Name'', @@global.server_uuid AS ''Value'' UNION ALL SELECT REPEAT(''-'', 23) AS ''Name'', v_banner AS ''Value'' UNION ALL SELECT ''MySQL Version'' AS ''Name'', VERSION() AS ''Value'' UNION ALL SELECT ''Sys Schema Version'' AS ''Name'', (SELECT sys_version FROM sys.version) AS ''Value'' UNION ALL SELECT ''Version Comment'' AS ''Name'', @@global.version_comment AS ''Value'' UNION ALL SELECT ''Version Compile OS'' AS ''Name'', @@global.version_compile_os AS ''Value'' UNION ALL SELECT ''Version Compile Machine'' AS ''Name'', @@global.version_compile_machine AS ''Value'' UNION ALL SELECT REPEAT(''-'', 23) AS ''Name'', v_banner AS ''Value'' UNION ALL SELECT ''UTC Time'' AS ''Name'', UTC_TIMESTAMP() AS ''Value'' UNION ALL SELECT ''Local Time'' AS ''Name'', NOW() AS ''Value'' UNION ALL SELECT ''Time Zone'' AS ''Name'', @@global.time_zone AS ''Value'' UNION ALL SELECT ''System Time Zone'' AS ''Name'', @@global.system_time_zone AS ''Value'' UNION ALL SELECT ''Time Zone Offset'' AS ''Name'', TIMEDIFF(NOW(), UTC_TIMESTAMP()) AS ''Value'';  SET v_has_innodb         = IFNULL((SELECT SUPPORT FROM information_schema.ENGINES WHERE ENGINE = ''InnoDB''), ''NO''), v_has_ndb            = IFNULL((SELECT SUPPORT FROM information_schema.ENGINES WHERE ENGINE = ''NDBCluster''), ''NO''), v_has_ps             = IFNULL((SELECT SUPPORT FROM information_schema.ENGINES WHERE ENGINE = ''PERFORMANCE_SCHEMA''), ''NO''), v_has_ps_replication = IF(v_has_ps = ''YES'' AND EXISTS(SELECT 1 FROM information_schema.TABLES WHERE TABLE_SCHEMA = ''performance_schema'' AND TABLE_NAME = ''replication_applier_status''), ''YES'', ''NO'' ), v_has_replication    =  IF(v_has_ps_replication = ''YES'', IF((SELECT COUNT(*) FROM performance_schema.replication_connection_status) > 0, ''YES'', ''NO''), IF(@@master_info_repository = ''TABLE'', IF((SELECT COUNT(*) FROM mysql.slave_master_info) > 0, ''YES'', ''NO''), IF(@@relay_log_info_repository = ''TABLE'', IF((SELECT COUNT(*) FROM mysql.slave_relay_log_info) > 0, ''YES'', ''NO''), ''MAYBE'')) ) , v_has_metrics        = IF(v_has_ps = ''YES'' OR (sys.version_major() = 5 AND sys.version_minor() = 6), ''YES'', ''NO''), v_has_ps_vars        = ''NO'';   SET v_has_ps_vars = IF(@@global.show_compatibility_56, ''NO'', ''YES'');  SET v_has_ps_vars = ''YES'';  IF (@sys.debug = ''ON'') THEN SELECT v_has_innodb AS ''Has_InnoDB'', v_has_ndb AS ''Has_NDBCluster'', v_has_ps AS ''Has_Performance_Schema'', v_has_ps_vars AS ''Has_P_S_SHOW_Variables'', v_has_metrics AS ''Has_metrics'', v_has_ps_replication ''AS Has_P_S_Replication'', v_has_replication AS ''Has_Replication''; END IF;  IF (v_has_innodb IN (''DEFAULT'', ''YES'')) THEN SET @sys.diagnostics.sql = ''SHOW ENGINE InnoDB STATUS''; PREPARE stmt_innodb_status FROM @sys.diagnostics.sql; END IF;  IF (v_has_ps = ''YES'') THEN SET @sys.diagnostics.sql = ''SHOW ENGINE PERFORMANCE_SCHEMA STATUS''; PREPARE stmt_ps_status FROM @sys.diagnostics.sql; END IF;  IF (v_has_ndb IN (''DEFAULT'', ''YES'')) THEN SET @sys.diagnostics.sql = ''SHOW ENGINE NDBCLUSTER STATUS''; PREPARE stmt_ndbcluster_status FROM @sys.diagnostics.sql; END IF;  SET @sys.diagnostics.sql_gen_query_template = ''SELECT CONCAT( ''SELECT '', GROUP_CONCAT( CASE WHEN (SUBSTRING(TABLE_NAME, 3), COLUMN_NAME) IN ( (''io_global_by_file_by_bytes'', ''total''), (''io_global_by_wait_by_bytes'', ''total_requested'') ) THEN CONCAT(''sys.format_bytes('', COLUMN_NAME, '') AS '', COLUMN_NAME) WHEN SUBSTRING(COLUMN_NAME, -8) = ''_latency'' THEN CONCAT(''sys.format_time('', COLUMN_NAME, '') AS '', COLUMN_NAME) WHEN SUBSTRING(COLUMN_NAME, -7) = ''_memory'' OR SUBSTRING(COLUMN_NAME, -17) = ''_memory_allocated'' OR ((SUBSTRING(COLUMN_NAME, -5) = ''_read'' OR SUBSTRING(COLUMN_NAME, -8) = ''_written'' OR SUBSTRING(COLUMN_NAME, -6) = ''_write'') AND SUBSTRING(COLUMN_NAME, 1, 6) <> ''COUNT_'') THEN CONCAT(''sys.format_bytes('', COLUMN_NAME, '') AS '', COLUMN_NAME) ELSE COLUMN_NAME END ORDER BY ORDINAL_POSITION SEPARATOR '',\n       '' ), ''\n  FROM tmp_'', SUBSTRING(TABLE_NAME FROM 3), ''_%{OUTPUT}'' ) AS Query INTO @sys.diagnostics.sql_select FROM information_schema.COLUMNS WHERE TABLE_SCHEMA = ''sys'' AND TABLE_NAME = ? GROUP BY TABLE_NAME'';  SET @sys.diagnostics.sql_gen_query_delta = ''SELECT CONCAT( ''SELECT '', GROUP_CONCAT( CASE WHEN FIND_IN_SET(COLUMN_NAME, diag.pk) THEN COLUMN_NAME WHEN diag.TABLE_NAME = ''io_global_by_file_by_bytes'' AND COLUMN_NAME = ''write_pct'' THEN CONCAT(''IFNULL(ROUND(100-(((e.total_read-IFNULL(s.total_read, 0))'', ''/NULLIF(((e.total_read-IFNULL(s.total_read, 0))+(e.total_written-IFNULL(s.total_written, 0))), 0))*100), 2), 0.00) AS '', COLUMN_NAME) WHEN (diag.TABLE_NAME, COLUMN_NAME) IN ( (''io_global_by_file_by_bytes'', ''total''), (''io_global_by_wait_by_bytes'', ''total_requested'') ) THEN CONCAT(''sys.format_bytes(e.'', COLUMN_NAME, ''-IFNULL(s.'', COLUMN_NAME, '', 0)) AS '', COLUMN_NAME) WHEN SUBSTRING(COLUMN_NAME, 1, 4) IN (''max_'', ''min_'') AND SUBSTRING(COLUMN_NAME, -8) = ''_latency'' THEN CONCAT(''sys.format_time(e.'', COLUMN_NAME, '') AS '', COLUMN_NAME) WHEN COLUMN_NAME = ''avg_latency'' THEN CONCAT(''sys.format_time((e.total_latency - IFNULL(s.total_latency, 0))'', ''/NULLIF(e.total - IFNULL(s.total, 0), 0)) AS '', COLUMN_NAME) WHEN SUBSTRING(COLUMN_NAME, -12) = ''_avg_latency'' THEN CONCAT(''sys.format_time((e.'', SUBSTRING(COLUMN_NAME FROM 1 FOR CHAR_LENGTH(COLUMN_NAME)-12), ''_latency - IFNULL(s.'', SUBSTRING(COLUMN_NAME FROM 1 FOR CHAR_LENGTH(COLUMN_NAME)-12), ''_latency, 0))'', ''/NULLIF(e.'', SUBSTRING(COLUMN_NAME FROM 1 FOR CHAR_LENGTH(COLUMN_NAME)-12), ''s - IFNULL(s.'', SUBSTRING(COLUMN_NAME FROM 1 FOR CHAR_LENGTH(COLUMN_NAME)-12), ''s, 0), 0)) AS '', COLUMN_NAME) WHEN SUBSTRING(COLUMN_NAME, -8) = ''_latency'' THEN CONCAT(''sys.format_time(e.'', COLUMN_NAME, '' - IFNULL(s.'', COLUMN_NAME, '', 0)) AS '', COLUMN_NAME) WHEN COLUMN_NAME IN (''avg_read'', ''avg_write'', ''avg_written'') THEN CONCAT(''sys.format_bytes(IFNULL((e.total_'', IF(COLUMN_NAME = ''avg_read'', ''read'', ''written''), ''-IFNULL(s.total_'', IF(COLUMN_NAME = ''avg_read'', ''read'', ''written''), '', 0))'', ''/NULLIF(e.count_'', IF(COLUMN_NAME = ''avg_read'', ''read'', ''write''), ''-IFNULL(s.count_'', IF(COLUMN_NAME = ''avg_read'', ''read'', ''write''), '', 0), 0), 0)) AS '', COLUMN_NAME) WHEN SUBSTRING(COLUMN_NAME, -7) = ''_memory'' OR SUBSTRING(COLUMN_NAME, -17) = ''_memory_allocated'' OR ((SUBSTRING(COLUMN_NAME, -5) = ''_read'' OR SUBSTRING(COLUMN_NAME, -8) = ''_written'' OR SUBSTRING(COLUMN_NAME, -6) = ''_write'') AND SUBSTRING(COLUMN_NAME, 1, 6) <> ''COUNT_'') THEN CONCAT(''sys.format_bytes(e.'', COLUMN_NAME, '' - IFNULL(s.'', COLUMN_NAME, '', 0)) AS '', COLUMN_NAME) ELSE CONCAT(''(e.'', COLUMN_NAME, '' - IFNULL(s.'', COLUMN_NAME, '', 0)) AS '', COLUMN_NAME) END ORDER BY ORDINAL_POSITION SEPARATOR '',\n       '' ), ''\n  FROM tmp_'', diag.TABLE_NAME, ''_end e LEFT OUTER JOIN tmp_'', diag.TABLE_NAME, ''_start s USING ('', diag.pk, '')'' ) AS Query INTO @sys.diagnostics.sql_select FROM tmp_sys_views_delta diag INNER JOIN information_schema.COLUMNS c ON c.TABLE_NAME = CONCAT(''x$'', diag.TABLE_NAME) WHERE c.TABLE_SCHEMA = ''sys'' AND diag.TABLE_NAME = ? GROUP BY diag.TABLE_NAME'';  IF (v_has_ps = ''YES'') THEN DROP TEMPORARY TABLE IF EXISTS tmp_sys_views_delta; CREATE TEMPORARY TABLE tmp_sys_views_delta ( TABLE_NAME varchar(64) NOT NULL, order_by text COMMENT ''ORDER BY clause for the initial and overall views'', order_by_delta text COMMENT ''ORDER BY clause for the delta views'', where_delta text COMMENT ''WHERE clause to use for delta views to only include rows with a "count" > 0'', limit_rows int unsigned COMMENT ''The maximum number of rows to include for the view'', pk varchar(128) COMMENT ''Used with the FIND_IN_SET() function so use comma separated list without whitespace'', PRIMARY KEY (TABLE_NAME) );  IF (@sys.debug = ''ON'') THEN SELECT ''Populating tmp_sys_views_delta'' AS ''Debug''; END IF; INSERT INTO tmp_sys_views_delta VALUES (''host_summary''                       , ''%{TABLE}.statement_latency DESC'', ''(e.statement_latency-IFNULL(s.statement_latency, 0)) DESC'', ''(e.statements - IFNULL(s.statements, 0)) > 0'', NULL, ''host''), (''host_summary_by_file_io''            , ''%{TABLE}.io_latency DESC'', ''(e.io_latency-IFNULL(s.io_latency, 0)) DESC'', ''(e.ios - IFNULL(s.ios, 0)) > 0'', NULL, ''host''), (''host_summary_by_file_io_type''       , ''%{TABLE}.host, %{TABLE}.total_latency DESC'', ''e.host, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''host,event_name''), (''host_summary_by_stages''             , ''%{TABLE}.host, %{TABLE}.total_latency DESC'', ''e.host, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''host,event_name''), (''host_summary_by_statement_latency''  , ''%{TABLE}.total_latency DESC'', ''(e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''host''), (''host_summary_by_statement_type''     , ''%{TABLE}.host, %{TABLE}.total_latency DESC'', ''e.host, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''host,sta