DESC'', ''(e.statement_latency-IFNULL(s.statement_latency, 0)) DESC'', ''(e.statements - IFNULL(s.statements, 0)) > 0'', NULL, ''user''), (''user_summary_by_file_io''            , ''%{TABLE}.io_latency DESC'', ''(e.io_latency-IFNULL(s.io_latency, 0)) DESC'', ''(e.ios - IFNULL(s.ios, 0)) > 0'', NULL, ''user''), (''user_summary_by_file_io_type''       , ''%{TABLE}.user, %{TABLE}.latency DESC'', ''e.user, (e.latency-IFNULL(s.latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''user,event_name''), (''user_summary_by_stages''             , ''%{TABLE}.user, %{TABLE}.total_latency DESC'', ''e.user, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''user,event_name''), (''user_summary_by_statement_latency''  , ''%{TABLE}.total_latency DESC'', ''(e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''user''), (''user_summary_by_statement_type''     , ''%{TABLE}.user, %{TABLE}.total_latency DESC'', ''e.user, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''user,statement''), (''wait_classes_global_by_avg_latency'' , ''IFNULL(%{TABLE}.total_latency / NULLIF(%{TABLE}.total, 0), 0) DESC'', ''IFNULL((e.total_latency-IFNULL(s.total_latency, 0)) / NULLIF((e.total - IFNULL(s.total, 0)), 0), 0) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''event_class''), (''wait_classes_global_by_latency''     , ''%{TABLE}.total_latency DESC'', ''(e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''event_class''), (''waits_by_host_by_latency''           , ''%{TABLE}.host, %{TABLE}.total_latency DESC'', ''e.host, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''host,event''), (''waits_by_user_by_latency''           , ''%{TABLE}.user, %{TABLE}.total_latency DESC'', ''e.user, (e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''user,event''), (''waits_global_by_latency''            , ''%{TABLE}.total_latency DESC'', ''(e.total_latency-IFNULL(s.total_latency, 0)) DESC'', ''(e.total - IFNULL(s.total, 0)) > 0'', NULL, ''events'') ; END IF;   SELECT ''  =======================  Configuration  =======================  '' AS ''''; SELECT ''GLOBAL VARIABLES'' AS ''The following output is:''; IF (v_has_ps_vars = ''YES'') THEN SELECT LOWER(VARIABLE_NAME) AS Variable_name, VARIABLE_VALUE AS Variable_value FROM performance_schema.global_variables ORDER BY VARIABLE_NAME; ELSE SELECT LOWER(VARIABLE_NAME) AS Variable_name, VARIABLE_VALUE AS Variable_value FROM information_schema.GLOBAL_VARIABLES ORDER BY VARIABLE_NAME; END IF;  IF (v_has_ps = ''YES'') THEN SELECT ''Performance Schema Setup - Actors'' AS ''The following output is:''; SELECT * FROM performance_schema.setup_actors;  SELECT ''Performance Schema Setup - Consumers'' AS ''The following output is:''; SELECT NAME AS Consumer, ENABLED, sys.ps_is_consumer_enabled(NAME) AS COLLECTS FROM performance_schema.setup_consumers;  SELECT ''Performance Schema Setup - Instruments'' AS ''The following output is:''; SELECT SUBSTRING_INDEX(NAME, ''/'', 2) AS ''InstrumentClass'', ROUND(100*SUM(IF(ENABLED = ''YES'', 1, 0))/COUNT(*), 2) AS ''EnabledPct'', ROUND(100*SUM(IF(TIMED = ''YES'', 1, 0))/COUNT(*), 2) AS ''TimedPct'' FROM performance_schema.setup_instruments GROUP BY SUBSTRING_INDEX(NAME, ''/'', 2) ORDER BY SUBSTRING_INDEX(NAME, ''/'', 2);  SELECT ''Performance Schema Setup - Objects'' AS ''The following output is:''; SELECT * FROM performance_schema.setup_objects;  SELECT ''Performance Schema Setup - Threads'' AS ''The following output is:''; SELECT `TYPE` AS ThreadType, COUNT(*) AS ''Total'', ROUND(100*SUM(IF(INSTRUMENTED = ''YES'', 1, 0))/COUNT(*), 2) AS ''InstrumentedPct'' FROM performance_schema.threads GROUP BY TYPE; END IF;   IF (v_has_replication = ''NO'') THEN SELECT ''No Replication Configured'' AS ''Replication Status''; ELSE SELECT CONCAT(''Replication Configured: '', v_has_replication, '' - Performance Schema Replication Tables: '', v_has_ps_replication) AS ''Replication Status'';  IF (v_has_ps_replication = ''YES'') THEN SELECT ''Replication - Connection Configuration'' AS ''The following output is:''; SELECT * FROM performance_schema.replication_connection_configuration ORDER BY CHANNEL_NAME ; END IF;  IF (v_has_ps_replication = ''YES'') THEN SELECT ''Replication - Applier Configuration'' AS ''The following output is:''; SELECT * FROM performance_schema.replication_applier_configuration ORDER BY CHANNEL_NAME; END IF;  IF (@@master_info_repository = ''TABLE'') THEN SELECT ''Replication - Master Info Repository Configuration'' AS ''The following output is:''; SELECT  Channel_name, Host, User_name, Port, Connect_retry, Enabled_ssl, Ssl_ca, Ssl_capath, Ssl_cert, Ssl_cipher, Ssl_key, Ssl_verify_server_cert, Heartbeat, Bind, Ignored_server_ids, Uuid, Retry_count, Ssl_crl, Ssl_crlpath, Tls_version, Enabled_auto_position FROM mysql.slave_master_info ORDER BY Channel_name ; END IF;  IF (@@relay_log_info_repository = ''TABLE'') THEN SELECT ''Replication - Relay Log Repository Configuration'' AS ''The following output is:''; SELECT  Channel_name, Sql_delay, Number_of_workers, Id FROM mysql.slave_relay_log_info ORDER BY Channel_name ; END IF; END IF;   IF (v_has_ndb IN (''DEFAULT'', ''YES'')) THEN SELECT ''Cluster Thread Blocks'' AS ''The following output is:''; SELECT * FROM ndbinfo.threadblocks; END IF;  IF (v_has_ps = ''YES'') THEN IF (@sys.diagnostics.include_raw = ''ON'') THEN SELECT ''  ========================  Initial Status  ========================  '' AS ''''; END IF;  DROP TEMPORARY TABLE IF EXISTS tmp_digests_start; CALL sys.statement_performance_analyzer(''create_tmp'', ''tmp_digests_start'', NULL); CALL sys.statement_performance_analyzer(''snapshot'', NULL, NULL); CALL sys.statement_performance_analyzer(''save'', ''tmp_digests_start'', NULL);  IF (@sys.diagnostics.include_raw = ''ON'') THEN SET @sys.diagnostics.sql = REPLACE(@sys.diagnostics.sql_gen_query_template, ''%{OUTPUT}'', ''start''); IF (@sys.debug = ''ON'') THEN SELECT ''The following query will be used to generate the query for each sys view'' AS ''Debug''; SELECT @sys.diagnostics.sql AS ''Debug''; END IF; PREPARE stmt_gen_query FROM @sys.diagnostics.sql; END IF; SET v_done = FALSE; OPEN c_sysviews_w_delta; c_sysviews_w_delta_loop: LOOP FETCH c_sysviews_w_delta INTO v_table_name; IF v_done THEN LEAVE c_sysviews_w_delta_loop; END IF;  IF (@sys.debug = ''ON'') THEN SELECT CONCAT(''The following queries are for storing the initial content of '', v_table_name) AS ''Debug''; END IF;  CALL sys.execute_prepared_stmt(CONCAT(''DROP TEMPORARY TABLE IF EXISTS `tmp_'', v_table_name, ''_start`'')); CALL sys.execute_prepared_stmt(CONCAT(''CREATE TEMPORARY TABLE `tmp_'', v_table_name, ''_start` SELECT * FROM `sys`.`x$'', v_table_name, ''`''));  IF (@sys.diagnostics.include_raw = ''ON'') THEN SET @sys.diagnostics.table_name = CONCAT(''x$'', v_table_name); EXECUTE stmt_gen_query USING @sys.diagnostics.table_name; SELECT CONCAT(@sys.diagnostics.sql_select, IF(order_by IS NOT NULL, CONCAT(''\n ORDER BY '', REPLACE(order_by, ''%{TABLE}'', CONCAT(''tmp_'', v_table_name, ''_start''))), ''''), IF(limit_rows IS NOT NULL, CONCAT(''\n LIMIT '', limit_rows), '''') ) INTO @sys.diagnostics.sql_select FROM tmp_sys_views_delta WHERE TABLE_NAME = v_table_name; SELECT CONCAT(''Initial '', v_table_name) AS ''The following output is:''; CALL sys.execute_prepared_stmt(@sys.diagnostics.sql_select); END IF; END LOOP; CLOSE c_sysviews_w_delta;  IF (@sys.diagnostics.include_raw = ''ON'') THEN DEALLOCATE PREPARE stmt_gen_query; END IF; END IF;  SET v_sql_status_summary_select = ''SELECT Variable_name'', v_sql_status_summary_delta  = '''', v_sql_status_summary_from   = '''';  REPEAT  SET v_output_count = v_output_count + 1; IF (v_output_count > 1) THEN SET v_sleep = in_interval-(UNIX_TIMESTAMP(NOW(2))-v_iter_start); SELECT NOW() AS ''Time'', CONCAT(''Going to sleep for '', v_sleep, '' seconds. Please do not interrupt'') AS ''The following output is:''; DO SLEEP(in_interval); END IF; SET v_iter_start = UNIX_TIMESTAMP(NOW(2));  SELECT NOW(), CONCAT(''Iteration Number '', IFNULL(v_output_count, ''NULL'')) AS ''The following output is:'';  IF (@@log_bin = 1) THEN SELECT ''SHOW MASTER STATUS'' AS ''The following output is:''; SHOW MASTER STATUS; END IF;  IF (v_has_replication <> ''NO'') THEN SELECT ''SHOW SLAVE STATUS'' AS ''The following output is:''; SHOW SLAVE STATUS;  IF (v_has_ps_replication = ''YES'') THEN SELECT ''Replication Connection Status'' AS ''The following output is:''; SELECT * FROM performance_schema.replication_connection_status;  SELECT ''Replication Applier Status'' AS ''The following output is:''; SELECT * FROM performance_schema.replication_applier_status ORDER BY CHANNEL_NAME;  SELECT ''Replication Applier Status - Coordinator'' AS ''The following output is:''; SELECT * FROM performance_schema.replication_applier_status_by_coordinator ORDER BY CHANNEL_NAME;  SELECT ''Replication Applier Status - Worker'' AS ''The following output is:''; SELECT * FROM performance_schema.replication_applier_status_by_worker ORDER BY CHANNEL_NAME, WORKER_ID; END IF;  IF (@@master_info_repository = ''TABLE'') THEN SELECT ''Replication - Master Log Status'' AS ''The following output is:''; SELECT Master_log_name, Master_log_pos FROM mysql.slave_master_info; END IF;  IF (@@relay_log_info_repository = ''TABLE'') THEN SELECT ''Replication - Relay Log Status'' AS ''The following output is:''; SELECT sys.format_path(Relay_log_name) AS Relay_log_name, Relay_log_pos, Master_log_name, Master_log_pos FROM mysql.slave_relay_log_info;  SELECT ''Replication - Worker Status'' AS ''The following output is:''; SELECT Id, sys.format_path(Relay_log_name) AS Relay_log_name, Relay_log_pos, Master_log_name, Master_log_pos, sys.format_path(Checkpoint_relay_log_name) AS Checkpoint_relay_log_name, Checkpoint_relay_log_pos, Checkpoint_master_log_name, Checkpoint_master_log_pos, Checkpoint_seqno, Checkpoint_group_size, HEX(Checkpoint_group_bitmap) AS Checkpoint_group_bitmap , Channel_name FROM mysql.slave_worker_info ORDER BY  Channel_name, Id; END IF; END IF;  SET v_table_name = CONCAT(''tmp_metrics_'', v_output_count); CALL sys.execute_prepared_stmt(CONCAT(''DROP TEMPORARY TABLE IF EXISTS '', v_table_name));  CALL sys.execute_prepared_stmt(CONCAT(''CREATE TEMPORARY TABLE '', v_table_name, '' ( Variable_name VARCHAR(193) NOT NULL, Variable_value VARCHAR(1024), Type VARCHAR(225) NOT NULL, Enabled ENUM(''YES'', ''NO'', ''PARTIAL'') NOT NULL, PRIMARY KEY (Type, Variable_name) ) ENGINE = InnoDB DEFAULT CHARSET=utf8''));  IF (v_has_metrics) THEN SET @sys.diagnostics.sql = CONCAT( ''INSERT INTO '', v_table_name, '' SELECT Variable_name, REPLACE(Variable_value, ''\n'', ''\\\\n'') AS Variable_value, Type, Enabled FROM sys.metrics'' ); ELSE SET @sys.diagnostics.sql = CONCAT( ''INSERT INTO '', v_table_name, ''(SELECT LOWER(VARIABLE_NAME) AS Variable_name, REPLACE(VARIABLE_VALUE, ''\n'', ''\\\\n'') AS Variable_value, ''Global Status'' AS Type, ''YES'' AS Enabled FROM performance_schema.global_status ) UNION ALL ( SELECT NAME AS Variable_name, COUNT AS Variable_value, CONCAT(''InnoDB Metrics - '', SUBSYSTEM) AS Type, IF(STATUS = ''enabled'', ''YES'', ''NO'') AS Enabled FROM information_schema.INNODB_METRICS WHERE NAME NOT IN ( ''lock_row_lock_time'', ''lock_row_lock_time_avg'', ''lock_row_lock_time_max'', ''lock_row_lock_waits'', ''buffer_pool_reads'', ''buffer_pool_read_requests'', ''buffer_pool_write_requests'', ''buffer_pool_wait_free'', ''buffer_pool_read_ahead'', ''buffer_pool_read_ahead_evicted'', ''buffer_pool_pages_total'', ''buffer_pool_pages_misc'', ''buffer_pool_pages_data'', ''buffer_pool_bytes_data'', ''buffer_pool_pages_dirty'', ''buffer_pool_bytes_dirty'', ''buffer_pool_pages_free'', ''buffer_pages_created'', ''buffer_pages_written'', ''buffer_pages_read'', ''buffer_data_reads'', ''buffer_data_written'', ''file_num_open_files'', ''os_log_bytes_written'', ''os_log_fsyncs'', ''os_log_pending_fsyncs'', ''os_log_pending_writes'', ''log_waits'', ''log_write_requests'', ''log_writes'', ''innodb_dblwr_writes'', ''innodb_dblwr_pages_written'', ''innodb_page_size'') ) UNION ALL ( SELECT ''NOW()'' AS Variable_name, NOW(3) AS Variable_value, ''System Time'' AS Type, ''YES'' AS Enabled ) UNION ALL ( SELECT ''UNIX_TIMESTAMP()'' AS Variable_name, ROUND(UNIX_TIMESTAMP(NOW(3)), 3) AS Variable_value, ''System Time'' AS Type, ''YES'' AS Enabled ) ORDER BY Type, Variable_name;'' ); END IF; CALL sys.execute_prepared_stmt(@sys.diagnostics.sql);  CALL sys.execute_prepared_stmt( CONCAT(''(SELECT Variable_value INTO @sys.diagnostics.output_time FROM '', v_table_name, '' WHERE Type = ''System Time'' AND Variable_name = ''UNIX_TIMESTAMP()'')'') ); SET v_output_time = @sys.diagnostics.output_time;  SET v_sql_status_summary_select = CONCAT(v_sql_status_summary_select, '', CONCAT( LEFT(s'', v_output_count, ''.Variable_value, '', v_status_summary_width, ''), IF('', REPLACE(v_no_delta_names, ''%{COUNT}'', v_output_count), '' AND s'', v_output_count, ''.Variable_value REGEXP ''^[0-9]+(\\\\.[0-9]+)?$'', CONCAT('' ('', ROUND(s'', v_output_count, ''.Variable_value/'', v_output_time, '', 2), ''/sec)''), '''') ) AS ''Output '', v_output_count, ''''''), v_sql_status_summary_from   = CONCAT(v_sql_status_summary_from, '' '', IF(v_output_count = 1, ''  FROM '', ''       INNER JOIN ''), v_table_name, '' s'', v_output_count, IF (v_output_count = 1, '''', '' USING (Type, Variable_name)'')); IF (v_output_count > 1) THEN SET v_sql_status_summary_delta  = CONCAT(v_sql_status_summary_delta, '', IF('', REPLACE(v_no_delta_names, ''%{COUNT}'', v_output_count), '' AND s'', (v_output_count-1), ''.Variable_value REGEXP ''^[0-9]+(\\\\.[0-9]+)?$'' AND s'', v_output_count, ''.Variable_value REGEXP ''^[0-9]+(\\\\.[0-9]+)?$'', CONCAT(IF(s'', (v_output_count-1), ''.Variable_value REGEXP ''^[0-9]+\\\\.[0-9]+$'' OR s'', v_output_count, ''.Variable_value REGEXP ''^[0-9]+\\\\.[0-9]+$'', ROUND((s'', v_output_count, ''.Variable_value-s'', (v_output_count-1), ''.Variable_value), 2), (s'', v_output_count, ''.Variable_value-s'', (v_output_count-1), ''.Variable_value) ), '' ('', ROUND((s'', v_output_count, ''.Variable_value-s'', (v_output_count-1), ''.Variable_value)/('', v_output_time, ''-'', v_output_time_prev, ''), 2), ''/sec)'' ), '''' ) AS ''Delta ('', (v_output_count-1), '' -> '', v_output_count, '')''''); END IF;  SET v_output_time_prev = v_output_time;  IF (@sys.diagnostics.include_raw = ''ON'') THEN IF (v_has_metrics) THEN SELECT ''SELECT * FROM sys.metrics'' AS ''The following output is:''; ELSE SELECT ''sys.metrics equivalent'' AS ''The following output is:''; END IF; CALL sys.execute_prepared_stmt(CONCAT(''SELECT Type, Variable_name, Enabled, Variable_value FROM '', v_table_name, '' ORDER BY Type, Variable_name'')); END IF;  IF (v_has_innodb IN (''DEFAULT'', ''YES'')) THEN SELECT ''SHOW ENGINE INNODB STATUS'' AS ''The following output is:''; EXECUTE stmt_innodb_status; SELECT ''InnoDB - Transactions'' AS ''The following output is:''; SELECT * FROM information_schema.INNODB_TRX; END IF;  IF (v_has_ndb IN (''DEFAULT'', ''YES'')) THEN SELECT ''SHOW ENGINE NDBCLUSTER STATUS'' AS ''The following output is:''; EXECUTE stmt_ndbcluster_status;  SELECT ''ndbinfo.memoryusage'' AS ''The following output is:''; SELECT node_id, memory_type, sys.format_bytes(used) AS used, used_pages, sys.format_bytes(total) AS total, total_pages, ROUND(100*(used/total), 2) AS ''Used %'' FROM ndbinfo.memoryusage;  SET v_done = FALSE; OPEN c_ndbinfo; c_ndbinfo_loop: LOOP FETCH c_ndbinfo INTO v_table_name; IF v_done THEN LEAVE c_ndbinfo_loop; END IF;  SELECT CONCAT(''SELECT * FROM ndbinfo.'', v_table_name) AS ''The following output is:''; CALL sys.execute_prepared_stmt(CONCAT(''SELECT * FROM `ndbinfo`.`'', v_table_name, ''`'')); END LOOP; CLOSE c_ndbinfo;  SELECT * FROM information_schema.FILES; END IF;  SELECT ''SELECT * FROM sys.processlist'' AS ''The following output is:''; SELECT processlist.* FROM sys.processlist;  IF (v_has_ps = ''YES'') THEN IF (sys.ps_is_consumer_enabled(''events_waits_history_long'') = ''YES'') THEN SELECT ''SELECT * FROM sys.latest_file_io'' AS ''The following output is:''; SELECT * FROM sys.latest_file_io; END IF;  IF (EXISTS(SELECT 1 FROM performance_schema.setup_instruments WHERE NAME LIKE ''memory/%'' AND ENABLED = ''YES'')) THEN SELECT ''SELECT * FROM sys.memory_by_host_by_current_bytes'' AS ''The following output is:''; SELECT * FROM sys.memory_by_host_by_current_bytes;  SELECT ''SELECT * FROM sys.memory_by_thread_by_current_bytes'' AS ''The following output is:''; SELECT * FROM sys.memory_by_thread_by_current_bytes;  SELECT ''SELECT * FROM sys.memory_by_user_by_current_bytes'' AS ''The following output is:''; SELECT * FROM sys.memory_by_user_by_current_bytes;  SELECT ''SELECT * FROM sys.memory_global_by_current_bytes'' AS ''The following output is:''; SELECT * FROM sys.memory_global_by_current_bytes; END IF; END IF;  SET v_runtime = (UNIX_TIMESTAMP(NOW(2)) - v_start); UNTIL (v_runtime + in_interval >= in_max_runtime) END REPEAT;  IF (v_has_ps = ''YES'') THEN SELECT ''SHOW ENGINE PERFORMANCE_SCHEMA STATUS'' AS ''The following output is:''; EXECUTE stmt_ps_status; END IF;  IF (v_has_innodb IN (''DEFAULT'', ''YES'')) THEN DEALLOCATE PREPARE stmt_innodb_status; END IF; IF (v_has_ps = ''YES'') THEN DEALLOCATE PREPARE stmt_ps_status; END IF; IF (v_has_ndb IN (''DEFAULT'', ''YES'')) THEN DEALLOCATE PREPARE stmt_ndbcluster_status; END IF;   SELECT ''  ============================  Schema Information  ============================  '' AS '''';  SELECT COUNT(*) AS ''Total Number of Tables'' FROM information_schema.TABLES;  IF (@sys.diagnostics.allow_i_s_tables = ''ON'') THEN SELECT ''Storage Engine Usage'' AS ''The following output is:''; SELECT ENGINE, COUNT(*) AS NUM_TABLES, sys.format_bytes(SUM(DATA_LENGTH)) AS DATA_LENGTH, sys.format_bytes(SUM(INDEX_LENGTH)) AS INDEX_LENGTH, sys.format_bytes(SUM(DATA_LENGTH+INDEX_LENGTH)) AS TOTAL FROM information_schema.TABLES GROUP BY ENGINE;  SELECT ''Schema Object Overview'' AS ''The following output is:''; SELECT * FROM sys.schema_object_overview;  SELECT ''Tables without a PRIMARY KEY'' AS ''The following output is:''; SELECT TABLES.TABLE_SCHEMA, ENGINE, COUNT(*) AS NumTables FROM information_schema.TABLES LEFT OUTER JOIN information_schema.STATISTICS ON STATISTICS.TABLE_SCHEMA = TABLES.TABLE_SCHEMA AND STATISTICS.TABLE_NAME = TABLES.TABLE_NAME AND STATISTICS.INDEX_NAME = ''PRIMARY'' WHERE STATISTICS.TABLE_NAME IS NULL AND TABLES.TABLE_SCHEMA NOT IN (''mysql'', ''information_schema'', ''performance_schema'', ''sys'') AND TABLES.TABLE_TYPE = ''BASE TABLE'' GROUP BY TABLES.TABLE_SCHEMA, ENGINE; END IF;  IF (v_has_ps = ''YES'') THEN SELECT ''Unused Indexes'' AS ''The following output is:''; SELECT object_schema, COUNT(*) AS NumUnusedIndexes FROM performance_schema.table_io_waits_summary_by_index_usage  WHERE index_name IS NOT NULL AND count_star = 0 AND object_schema NOT IN (''mysql'', ''sys'') AND index_name != ''PRIMARY'' GROUP BY object_schema; END IF;  IF (v_has_ps = ''YES'') THEN SELECT ''  =========================  Overall Status  =========================  '' AS '''';  SELECT ''CALL sys.ps_statement_avg_latency_histogram()'' AS ''The following output is:''; CALL sys.ps_statement_avg_latency_histogram();  CALL sys.statement_performance_analyzer(''snapshot'', NULL, NULL); CALL sys.statement_performance_analyzer(''overall'', NULL, ''with_runtimes_in_95th_percentile'');  SET @sys.diagnostics.sql = REPLACE(@sys.diagnostics.sql_gen_query_template, ''%{OUTPUT}'', ''end''); IF (@sys.debug = ''ON'') THEN SELECT ''The following query will be used to generate the query for each sys view'' AS ''Debug''; SELECT @sys.diagnostics.sql AS ''Debug''; END IF; PREPARE stmt_gen_query FROM @sys.diagnostics.sql;  SET v_done = FALSE; OPEN c_sysviews_w_delta; c_sysviews_w_delta_loop: LOOP FETCH c_sysviews_w_delta INTO v_table_name; IF v_done THEN LEAVE c_sysviews_w_delta_loop; END IF;  IF (@sys.debug = ''ON'') THEN SELECT CONCAT(''The following queries are for storing the final content of '', v_table_name) AS ''Debug''; END IF;  CALL sys.execute_prepared_stmt(CONCAT(''DROP TEMPORARY TABLE IF EXISTS `tmp_'', v_table_name, ''_end`'')); CALL sys.execute_prepared_stmt(CONCAT(''CREATE TEMPORARY TABLE `tmp_'', v_table_name, ''_end` SELECT * FROM `sys`.`x$'', v_table_name, ''`''));  IF (@sys.diagnostics.include_raw = ''ON'') THEN SET @sys.diagnostics.table_name = CONCAT(''x$'', v_table_name); EXECUTE stmt_gen_query USING @sys.diagnostics.table_name; SELECT CONCAT(@sys.diagnostics.sql_select, IF(order_by IS NOT NULL, CONCAT(''\n ORDER BY '', REPLACE(order_by, ''%{TABLE}'', CONCAT(''tmp_'', v_table_name, ''_end''))), ''''), IF(limit_rows IS NOT NULL, CONCAT(''\n LIMIT '', limit_rows), '''') ) INTO @sys.diagnostics.sql_select FROM tmp_sys_views_delta WHERE TABLE_NAME = v_table_name; SELECT CONCAT(''Overall '', v_table_name) AS ''The following output is:''; CALL sys.execute_prepared_stmt(@sys.diagnostics.sql_select); END IF; END LOOP; CLOSE c_sysviews_w_delta;  DEALLOCATE PREPARE stmt_gen_query;   SELECT ''  ======================  Delta Status  ======================  '' AS '''';  CALL sys.statement_performance_analyzer(''delta'', ''tmp_digests_start'', ''with_runtimes_in_95th_percentile''); CALL sys.statement_performance_analyzer(''cleanup'', NULL, NULL);  DROP TEMPORARY TABLE tmp_digests_start;  IF (@sys.debug = ''ON'') THEN SELECT ''The following query will be used to generate the query for each sys view delta'' AS ''Debug''; SELECT @sys.diagnostics.sql_gen_query_delta AS ''Debug''; END IF; PREPARE stmt_gen_query_delta FROM @sys.diagnostics.sql_gen_query_delta;  SET v_old_group_concat_max_len = @@session.group_concat_max_len; SET @@session.group_concat_max_len = 2048; SET v_done = FALSE; OPEN c_sysviews_w_delta; c_sysviews_w_delta_loop: LOOP FETCH c_sysviews_w_delta INTO v_table_name; IF v_done THEN LEAVE c_sysviews_w_delta_loop; END IF;  SET @sys.diagnostics.table_name = v_table_name; EXECUTE stmt_gen_query_delta USING @sys.diagnostics.table_name; SELECT CONCAT(@sys.diagnostics.sql_select, IF(where_delta IS NOT NULL, CONCAT(''\n WHERE '', where_delta), ''''), IF(order_by_delta IS NOT NULL, CONCAT(''\n ORDER BY '', order_by_delta), ''''), IF(limit_rows IS NOT NULL, CONCAT(''\n LIMIT '', limit_rows), '''') ) INTO @sys.diagnostics.sql_select FROM tmp_sys_views_delta WHERE TABLE_NAME = v_table_name;  SELECT CONCAT(''Delta '', v_table_name) AS ''The following output is:''; CALL sys.execute_prepared_stmt(@sys.diagnostics.sql_select);  CALL sys.execute_prepared_stmt(CONCAT(''DROP TEMPORARY TABLE `tmp_'', v_table_name, ''_end`'')); CALL sys.execute_prepared_stmt(CONCAT(''DROP TEMPORARY TABLE `tmp_'', v_table_name, ''_start`'')); END LOOP; CLOSE c_sysviews_w_delta; SET @@session.group_concat_max_len = v_old_group_concat_max_len;  DEALLOCATE PREPARE stmt_gen_query_delta; DROP TEMPORARY TABLE tmp_sys_views_delta; END IF;  IF (v_has_metrics) THEN SELECT ''SELECT * FROM sys.metrics'' AS ''The following output is:''; ELSE SELECT ''sys.metrics equivalent'' AS ''The following output is:''; END IF; CALL sys.execute_prepared_stmt( CONCAT(v_sql_status_summary_select, v_sql_status_summary_delta, '', Type, s1.Enabled'', v_sql_status_summary_from, '' ORDER BY Type, Variable_name'' ) );  SET v_count = 0; WHILE (v_count < v_output_count) DO SET v_count = v_count + 1; SET v_table_name = CONCAT(''tmp_metrics_'', v_count); CALL sys.execute_prepared_stmt(CONCAT(''DROP TEMPORARY TABLE IF EXISTS '', v_table_name)); END WHILE;  IF (in_auto_config <> ''current'') THEN CALL sys.ps_setup_reload_saved(); SET sql_log_bin = @log_bin; END IF;  SET @sys.diagnostics.output_time            = NULL, @sys.diagnostics.sql                    = NULL, @sys.diagnostics.sql_gen_query_delta    = NULL, @sys.diagnostics.sql_gen_query_template = NULL, @sys.diagnostics.sql_select             = NULL, @sys.diagnostics.table_name             = NULL;  IF (v_this_thread_enabled = ''YES'') THEN CALL sys.ps_setup_enable_thread(CONNECTION_ID()); END IF;  IF (@log_bin = 1) THEN SET sql_log_bin = @log_bin; END IF; END', NULL, NULL, 'SQL', 'NO', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Create a report of the current status of the server for diagnostics purposes. Data collected includes (some items depends on versions and settings):\n \n * The GLOBAL VARIABLES\n * Several sys schema views including metrics or equivalent (depending on version and settings)\n * Queries in the 95th percentile\n * Several ndbinfo views for MySQL Cluster\n * Replication (both master and slave) information.\n \n Some of the sys schema views are calculated as initial (optional), overall, delta:\n \n * The initial view is the content of the view at the start of this procedure.\n This output will be the same as the the start values used for the delta view.\n The initial view is included if @sys.diagnostics.include_raw = ''ON''.\n * The overall view is the content of the view at the end of this procedure.\n This output is the same as the end values used for the delta view.\n The overall view is always included.\n * The delta view is the difference from the beginning to the end. Note that for min and max values\n they are simply the min or max value from the end view respectively, so does not necessarily reflect\n the minimum/maximum value in the monitored period.\n Note: except for the metrics views the delta is only calculation between the first and last outputs.\n \n Requires the SUPER privilege for "SET sql_log_bin = 0;".\n \n Versions supported:\n * MySQL 5.6: 5.6.10 and later\n * MySQL 5.7: 5.7.9 and later\n \n Parameters\n \n in_max_runtime (INT UNSIGNED):\n The maximum time to keep collecting data.\n Use NULL to get the default which is 60 seconds, otherwise enter a value greater than 0.\n in_interval (INT UNSIGNED):\n How long to sleep between data collections.\n Use NULL to get the default which is 30 seconds, otherwise enter a value greater than 0.\n in_auto_config (ENUM(''current'', ''medium'', ''full''))\n Automatically enable Performance Schema instruments and consumers.\n NOTE: The more that are enabled, the more impact on the performance.\n Supported values are:\n * current - use the current settings.\n * medium - enable some settings.\n * full - enables all settings. This will have a big impact on the\n performance - be careful using this option.\n If another setting the ''current'' is chosen, the current settings\n are restored at the end of the procedure.\n \n \n Configuration Options\n \n sys.diagnostics.allow_i_s_tables\n Specifies whether it is allowed to do table scan queries on information_schema.TABLES. This can be expensive if there\n are many tables. Set to ''ON'' to allow, ''OFF'' to not allow.\n Default is ''OFF''.\n \n sys.diagnostics.include_raw\n Set to ''ON'' to include the raw data (e.g. the original output of "SELECT * FROM sys.metrics").\n Use this to get the initial values of the various views.\n Default is ''OFF''.\n \n sys.statement_truncate_len\n How much of queries in the process list output to include.\n Default is 64.\n \n sys.debug\n Whether to provide debugging output.\n Default is ''OFF''. Set to ''ON'' to include.\n \n \n Example\n \n To create a report and append it to the file diag.out:\n \n mysql> TEE diag.out;\n mysql> CALL sys.diagnostics(120, 30, ''current'');\n ...\n mysql> NOTEE;\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('execute_prepared_stmt', 'def', 'sys', 'execute_prepared_stmt', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN IF (@sys.debug IS NULL) THEN SET @sys.debug = sys.sys_get_config(''debug'', ''OFF''); END IF;  IF (in_query IS NULL OR LENGTH(in_query) < 4) THEN SIGNAL SQLSTATE ''45000'' SET MESSAGE_TEXT = "The @sys.execute_prepared_stmt.sql must contain a query"; END IF;  SET @sys.execute_prepared_stmt.sql = in_query;  IF (@sys.debug = ''ON'') THEN SELECT @sys.execute_prepared_stmt.sql AS ''Debug''; END IF; PREPARE sys_execute_prepared_stmt FROM @sys.execute_prepared_stmt.sql; EXECUTE sys_execute_prepared_stmt; DEALLOCATE PREPARE sys_execute_prepared_stmt;  SET @sys.execute_prepared_stmt.sql = NULL; END', NULL, NULL, 'SQL', 'NO', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Takes the query in the argument and executes it using a prepared statement. The prepared statement is deallocated,\n so the procedure is mainly useful for executing one off dynamically created queries.\n \n The sys_execute_prepared_stmt prepared statement name is used for the query and is required not to exist.\n \n \n Parameters\n \n in_query (longtext CHARACTER SET UTF8):\n The query to execute.\n \n \n Configuration Options\n \n sys.debug\n Whether to provide debugging output.\n Default is ''OFF''. Set to ''ON'' to include.\n \n \n Example\n \n mysql> CALL sys.execute_prepared_stmt(''SELECT * FROM sys.sys_config'');\n +------------------------+-------+---------------------+--------+\n | variable               | value | set_time            | set_by |\n +------------------------+-------+---------------------+--------+\n | statement_truncate_len | 64    | 2015-06-30 13:06:00 | NULL   |\n +------------------------+-------+---------------------+--------+\n 1 row in set (0.00 sec)\n \n Query OK, 0 rows affected (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('extract_schema_from_file_name', 'def', 'sys', 'extract_schema_from_file_name', 'FUNCTION', 'varchar', 64, 192, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'varchar(64)', 'SQL', 'BEGIN RETURN LEFT(SUBSTRING_INDEX(SUBSTRING_INDEX(REPLACE(path, ''\\'', ''/''), ''/'', -2), ''/'', 1), 64); END', NULL, NULL, 'SQL', 'YES', 'NO SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a raw file path, and attempts to extract the schema name from it.\n \n Useful for when interacting with Performance Schema data \n concerning IO statistics, for example.\n \n Currently relies on the fact that a table data file will be within a \n specified database directory (will not work with partitions or tables\n that specify an individual DATA_DIRECTORY).\n \n Parameters\n \n path (VARCHAR(512)):\n The full file path to a data file to extract the schema name from.\n \n Returns\n \n VARCHAR(64)\n \n Example\n \n mysql> SELECT sys.extract_schema_from_file_name(''/var/lib/mysql/employees/employee.ibd'');\n +----------------------------------------------------------------------------+\n | sys.extract_schema_from_file_name(''/var/lib/mysql/employees/employee.ibd'') |\n +----------------------------------------------------------------------------+\n | employees                                                                  |\n +----------------------------------------------------------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('extract_table_from_file_name', 'def', 'sys', 'extract_table_from_file_name', 'FUNCTION', 'varchar', 64, 192, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'varchar(64)', 'SQL', 'BEGIN RETURN LEFT(SUBSTRING_INDEX(REPLACE(SUBSTRING_INDEX(REPLACE(path, ''\\'', ''/''), ''/'', -1), ''@0024'', ''$''), ''.'', 1), 64); END', NULL, NULL, 'SQL', 'YES', 'NO SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a raw file path, and extracts the table name from it.\n \n Useful for when interacting with Performance Schema data \n concerning IO statistics, for example.\n \n Parameters\n \n path (VARCHAR(512)):\n The full file path to a data file to extract the table name from.\n \n Returns\n \n VARCHAR(64)\n \n Example\n \n mysql> SELECT sys.extract_table_from_file_name(''/var/lib/mysql/employees/employee.ibd'');\n +---------------------------------------------------------------------------+\n | sys.extract_table_from_file_name(''/var/lib/mysql/employees/employee.ibd'') |\n +---------------------------------------------------------------------------+\n | employee                                                                  |\n +---------------------------------------------------------------------------+\n 1 row in set (0.02 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('format_bytes', 'def', 'sys', 'format_bytes', 'FUNCTION', 'text', 65535, 65535, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'text', 'SQL', 'BEGIN IF bytes IS NULL THEN RETURN NULL; ELSEIF bytes >= 1125899906842624 THEN RETURN CONCAT(ROUND(bytes / 1125899906842624, 2), '' PiB''); ELSEIF bytes >= 1099511627776 THEN RETURN CONCAT(ROUND(bytes / 1099511627776, 2), '' TiB''); ELSEIF bytes >= 1073741824 THEN RETURN CONCAT(ROUND(bytes / 1073741824, 2), '' GiB''); ELSEIF bytes >= 1048576 THEN RETURN CONCAT(ROUND(bytes / 1048576, 2), '' MiB''); ELSEIF bytes >= 1024 THEN RETURN CONCAT(ROUND(bytes / 1024, 2), '' KiB''); ELSE RETURN CONCAT(ROUND(bytes, 0), '' bytes''); END IF; END', NULL, NULL, 'SQL', 'YES', 'NO SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a raw bytes value, and converts it to a human readable format.\n \n Parameters\n \n bytes (TEXT):\n A raw bytes value.\n \n Returns\n \n TEXT\n \n Example\n \n mysql> SELECT sys.format_bytes(2348723492723746) AS size;\n +----------+\n | size     |\n +----------+\n | 2.09 PiB |\n +----------+\n 1 row in set (0.00 sec)\n \n mysql> SELECT sys.format_bytes(2348723492723) AS size;\n +----------+\n | size     |\n +----------+\n | 2.14 TiB |\n +----------+\n 1 row in set (0.00 sec)\n \n mysql> SELECT sys.format_bytes(23487234) AS size;\n +-----------+\n | size      |\n +-----------+\n | 22.40 MiB |\n +-----------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('format_path', 'def', 'sys', 'format_path', 'FUNCTION', 'varchar', 512, 1536, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'varchar(512)', 'SQL', 'BEGIN DECLARE v_path VARCHAR(512); DECLARE v_undo_dir VARCHAR(1024);  DECLARE path_separator CHAR(1) DEFAULT ''/'';  IF @@global.version_compile_os LIKE ''win%'' THEN SET path_separator = ''\\''; END IF;  IF in_path LIKE ''/private/%'' THEN SET v_path = REPLACE(in_path, ''/private'', ''''); ELSE SET v_path = in_path; END IF;  SET v_undo_dir = IFNULL((SELECT VARIABLE_VALUE FROM performance_schema.global_variables WHERE VARIABLE_NAME = ''innodb_undo_directory''), '''');  IF v_path IS NULL THEN RETURN NULL; ELSEIF v_path LIKE CONCAT(@@global.datadir, IF(SUBSTRING(@@global.datadir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, @@global.datadir, CONCAT(''@@datadir'', IF(SUBSTRING(@@global.datadir, -1) = path_separator, path_separator, ''''))); ELSEIF v_path LIKE CONCAT(@@global.tmpdir, IF(SUBSTRING(@@global.tmpdir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, @@global.tmpdir, CONCAT(''@@tmpdir'', IF(SUBSTRING(@@global.tmpdir, -1) = path_separator, path_separator, ''''))); ELSEIF v_path LIKE CONCAT(@@global.slave_load_tmpdir, IF(SUBSTRING(@@global.slave_load_tmpdir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, @@global.slave_load_tmpdir, CONCAT(''@@slave_load_tmpdir'', IF(SUBSTRING(@@global.slave_load_tmpdir, -1) = path_separator, path_separator, ''''))); ELSEIF v_path LIKE CONCAT(@@global.innodb_data_home_dir, IF(SUBSTRING(@@global.innodb_data_home_dir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, @@global.innodb_data_home_dir, CONCAT(''@@innodb_data_home_dir'', IF(SUBSTRING(@@global.innodb_data_home_dir, -1) = path_separator, path_separator, ''''))); ELSEIF v_path LIKE CONCAT(@@global.innodb_log_group_home_dir, IF(SUBSTRING(@@global.innodb_log_group_home_dir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, @@global.innodb_log_group_home_dir, CONCAT(''@@innodb_log_group_home_dir'', IF(SUBSTRING(@@global.innodb_log_group_home_dir, -1) = path_separator, path_separator, ''''))); ELSEIF v_path LIKE CONCAT(v_undo_dir, IF(SUBSTRING(v_undo_dir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, v_undo_dir, CONCAT(''@@innodb_undo_directory'', IF(SUBSTRING(v_undo_dir, -1) = path_separator, path_separator, ''''))); ELSEIF v_path LIKE CONCAT(@@global.basedir, IF(SUBSTRING(@@global.basedir, -1) = path_separator, ''%'', CONCAT(path_separator, ''%''))) ESCAPE ''|'' THEN SET v_path = REPLACE(v_path, @@global.basedir, CONCAT(''@@basedir'', IF(SUBSTRING(@@global.basedir, -1) = path_separator, path_separator, ''''))); END IF;  RETURN v_path; END', NULL, NULL, 'SQL', 'YES', 'NO SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a raw path value, and strips out the datadir or tmpdir\n replacing with @@datadir and @@tmpdir respectively. \n \n Also normalizes the paths across operating systems, so backslashes\n on Windows are converted to forward slashes\n \n Parameters\n \n path (VARCHAR(512)):\n The raw file path value to format.\n \n Returns\n \n VARCHAR(512) CHARSET UTF8\n \n Example\n \n mysql> select @@datadir;\n +-----------------------------------------------+\n | @@datadir                                     |\n +-----------------------------------------------+\n | /Users/mark/sandboxes/SmallTree/AMaster/data/ |\n +-----------------------------------------------+\n 1 row in set (0.06 sec)\n \n mysql> select format_path(''/Users/mark/sandboxes/SmallTree/AMaster/data/mysql/proc.MYD'') AS path;\n +--------------------------+\n | path                     |\n +--------------------------+\n | @@datadir/mysql/proc.MYD |\n +--------------------------+\n 1 row in set (0.03 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('format_statement', 'def', 'sys', 'format_statement', 'FUNCTION', 'longtext', 2147483647, 2147483647, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'longtext', 'SQL', 'BEGIN IF @sys.statement_truncate_len IS NULL THEN SET @sys.statement_truncate_len = sys_get_config(''statement_truncate_len'', 64); END IF;  IF CHAR_LENGTH(statement) > @sys.statement_truncate_len THEN RETURN REPLACE(CONCAT(LEFT(statement, (@sys.statement_truncate_len/2)-2), '' ... '', RIGHT(statement, (@sys.statement_truncate_len/2)-2)), ''\n'', '' ''); ELSE  RETURN REPLACE(statement, ''\n'', '' ''); END IF; END', NULL, NULL, 'SQL', 'YES', 'NO SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Formats a normalized statement, truncating it if it is > 64 characters long by default.\n \n To configure the length to truncate the statement to by default, update the `statement_truncate_len`\n variable with `sys_config` table to a different value. Alternatively, to change it just for just \n your particular session, use `SET @sys.statement_truncate_len := <some new value>`.\n \n Useful for printing statement related data from Performance Schema from \n the command line.\n \n Parameters\n \n statement (LONGTEXT): \n The statement to format.\n \n Returns\n \n LONGTEXT\n \n Example\n \n mysql> SELECT sys.format_statement(digest_text)\n ->   FROM performance_schema.events_statements_summary_by_digest\n ->  ORDER by sum_timer_wait DESC limit 5;\n +-------------------------------------------------------------------+\n | sys.format_statement(digest_text)                                 |\n +-------------------------------------------------------------------+\n | CREATE SQL SECURITY INVOKER VI ... KE ? AND `variable_value` > ?  |\n | CREATE SQL SECURITY INVOKER VI ... ait` IS NOT NULL , `esc` . ... |\n | CREATE SQL SECURITY INVOKER VI ... ait` IS NOT NULL , `sys` . ... |\n | CREATE SQL SECURITY INVOKER VI ...  , `compressed_size` ) ) DESC  |\n | CREATE SQL SECURITY INVOKER VI ... LIKE ? ORDER BY `timer_start`  |\n +-------------------------------------------------------------------+\n 5 rows in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('format_time', 'def', 'sys', 'format_time', 'FUNCTION', 'text', 65535, 65535, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'text', 'SQL', 'BEGIN IF picoseconds IS NULL THEN RETURN NULL; ELSEIF picoseconds >= 604800000000000000 THEN RETURN CONCAT(ROUND(picoseconds / 604800000000000000, 2), '' w''); ELSEIF picoseconds >= 86400000000000000 THEN RETURN CONCAT(ROUND(picoseconds / 86400000000000000, 2), '' d''); ELSEIF picoseconds >= 3600000000000000 THEN RETURN CONCAT(ROUND(picoseconds / 3600000000000000, 2), '' h''); ELSEIF picoseconds >= 60000000000000 THEN RETURN CONCAT(ROUND(picoseconds / 60000000000000, 2), '' m''); ELSEIF picoseconds >= 1000000000000 THEN RETURN CONCAT(ROUND(picoseconds / 1000000000000, 2), '' s''); ELSEIF picoseconds >= 1000000000 THEN RETURN CONCAT(ROUND(picoseconds / 1000000000, 2), '' ms''); ELSEIF picoseconds >= 1000000 THEN RETURN CONCAT(ROUND(picoseconds / 1000000, 2), '' us''); ELSEIF picoseconds >= 1000 THEN RETURN CONCAT(ROUND(picoseconds / 1000, 2), '' ns''); ELSE RETURN CONCAT(picoseconds, '' ps''); END IF; END', NULL, NULL, 'SQL', 'YES', 'NO SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a raw picoseconds value, and converts it to a human readable form.\n \n Picoseconds are the precision that all latency values are printed in \n within Performance Schema, however are not user friendly when wanting\n to scan output from the command line.\n \n Parameters\n \n picoseconds (TEXT): \n The raw picoseconds value to convert.\n \n Returns\n \n TEXT\n \n Example\n \n mysql> select format_time(342342342342345);\n +------------------------------+\n | format_time(342342342342345) |\n +------------------------------+\n | 00:05:42                     |\n +------------------------------+\n 1 row in set (0.00 sec)\n \n mysql> select format_time(342342342);\n +------------------------+\n | format_time(342342342) |\n +------------------------+\n | 342.34 us              |\n +------------------------+\n 1 row in set (0.00 sec)\n \n mysql> select format_time(34234);\n +--------------------+\n | format_time(34234) |\n +--------------------+\n | 34.23 ns           |\n +--------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('list_add', 'def', 'sys', 'list_add', 'FUNCTION', 'text', 65535, 65535, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'text', 'SQL', 'BEGIN  IF (in_add_value IS NULL) THEN SIGNAL SQLSTATE ''02200'' SET MESSAGE_TEXT = ''Function sys.list_add: in_add_value input variable should not be NULL'', MYSQL_ERRNO = 1138; END IF;  IF (in_list IS NULL OR LENGTH(in_list) = 0) THEN RETURN in_add_value; END IF;  RETURN (SELECT CONCAT(TRIM(BOTH '','' FROM TRIM(in_list)), '','', in_add_value));  END', NULL, NULL, 'SQL', 'YES', 'CONTAINS SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a list, and a value to add to the list, and returns the resulting list.\n \n Useful for altering certain session variables, like sql_mode or optimizer_switch for instance.\n \n Parameters\n \n in_list (TEXT):\n The comma separated list to add a value to\n \n in_add_value (TEXT):\n The value to add to the input list\n \n Returns\n \n TEXT\n \n Example\n \n mysql> select @@sql_mode;\n +-----------------------------------------------------------------------------------+\n | @@sql_mode                                                                        |\n +-----------------------------------------------------------------------------------+\n | ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION |\n +-----------------------------------------------------------------------------------+\n 1 row in set (0.00 sec)\n \n mysql> set sql_mode = sys.list_add(@@sql_mode, ''ANSI_QUOTES'');\n Query OK, 0 rows affected (0.06 sec)\n \n mysql> select @@sql_mode;\n +-----------------------------------------------------------------------------------------------+\n | @@sql_mode                                                                                    |\n +-----------------------------------------------------------------------------------------------+\n | ANSI_QUOTES,ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION |\n +-----------------------------------------------------------------------------------------------+\n 1 row in set (0.00 sec)\n \n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('list_drop', 'def', 'sys', 'list_drop', 'FUNCTION', 'text', 65535, 65535, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'text', 'SQL', 'BEGIN  IF (in_drop_value IS NULL) THEN SIGNAL SQLSTATE ''02200'' SET MESSAGE_TEXT = ''Function sys.list_drop: in_drop_value input variable should not be NULL'', MYSQL_ERRNO = 1138; END IF;  IF (in_list IS NULL OR LENGTH(in_list) = 0) THEN RETURN in_list; END IF;  RETURN (SELECT TRIM(BOTH '','' FROM REPLACE(REPLACE(CONCAT('','', in_list), CONCAT('','', in_drop_value), ''''), CONCAT('', '', in_drop_value), '''')));  END', NULL, NULL, 'SQL', 'YES', 'CONTAINS SQL', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Takes a list, and a value to attempt to remove from the list, and returns the resulting list.\n \n Useful for altering certain session variables, like sql_mode or optimizer_switch for instance.\n \n Parameters\n \n in_list (TEXT):\n The comma separated list to drop a value from\n \n in_drop_value (TEXT):\n The value to drop from the input list\n \n Returns\n \n TEXT\n \n Example\n \n mysql> select @@sql_mode;\n +-----------------------------------------------------------------------------------------------+\n | @@sql_mode                                                                                    |\n +-----------------------------------------------------------------------------------------------+\n | ANSI_QUOTES,ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION |\n +-----------------------------------------------------------------------------------------------+\n 1 row in set (0.00 sec)\n \n mysql> set sql_mode = sys.list_drop(@@sql_mode, ''ONLY_FULL_GROUP_BY'');\n Query OK, 0 rows affected (0.03 sec)\n \n mysql> select @@sql_mode;\n +----------------------------------------------------------------------------+\n | @@sql_mode                                                                 |\n +----------------------------------------------------------------------------+\n | ANSI_QUOTES,STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION |\n +----------------------------------------------------------------------------+\n 1 row in set (0.00 sec)\n \n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_is_account_enabled', 'def', 'sys', 'ps_is_account_enabled', 'FUNCTION', 'enum', 3, 9, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'enum(''YES'',''NO'')', 'SQL', 'BEGIN RETURN IF(EXISTS(SELECT 1 FROM performance_schema.setup_actors WHERE (`HOST` = ''%'' OR in_host LIKE `HOST`) AND (`USER` = ''%'' OR `USER` = in_user) AND (`ENABLED` = ''YES'') ), ''YES'', ''NO'' ); END', NULL, NULL, 'SQL', 'YES', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Determines whether instrumentation of an account is enabled \n within Performance Schema.\n \n Parameters\n \n in_host VARCHAR(60): \n The hostname of the account to check.\n in_user VARCHAR(32):\n The username of the account to check.\n \n Returns\n \n ENUM(''YES'', ''NO'', ''PARTIAL'')\n \n Example\n \n mysql> SELECT sys.ps_is_account_enabled(''localhost'', ''root'');\n +------------------------------------------------+\n | sys.ps_is_account_enabled(''localhost'', ''root'') |\n +------------------------------------------------+\n | YES                                            |\n +------------------------------------------------+\n 1 row in set (0.01 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_is_consumer_enabled', 'def', 'sys', 'ps_is_consumer_enabled', 'FUNCTION', 'enum', 3, 9, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'enum(''YES'',''NO'')', 'SQL', 'BEGIN RETURN ( SELECT (CASE WHEN c.NAME = ''global_instrumentation'' THEN c.ENABLED WHEN c.NAME = ''thread_instrumentation'' THEN IF(cg.ENABLED = ''YES'' AND c.ENABLED = ''YES'', ''YES'', ''NO'') WHEN c.NAME LIKE ''%\\_digest''           THEN IF(cg.ENABLED = ''YES'' AND c.ENABLED = ''YES'', ''YES'', ''NO'') WHEN c.NAME LIKE ''%\\_current''          THEN IF(cg.ENABLED = ''YES'' AND ct.ENABLED = ''YES'' AND c.ENABLED = ''YES'', ''YES'', ''NO'') ELSE IF(cg.ENABLED = ''YES'' AND ct.ENABLED = ''YES'' AND c.ENABLED = ''YES'' AND ( SELECT cc.ENABLED FROM performance_schema.setup_consumers cc WHERE NAME = CONCAT(SUBSTRING_INDEX(c.NAME, ''_'', 2), ''_current'') ) = ''YES'', ''YES'', ''NO'') END) AS IsEnabled FROM performance_schema.setup_consumers c INNER JOIN performance_schema.setup_consumers cg INNER JOIN performance_schema.setup_consumers ct WHERE cg.NAME       = ''global_instrumentation'' AND ct.NAME   = ''thread_instrumentation'' AND c.NAME    = in_consumer ); END', NULL, NULL, 'SQL', 'YES', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Determines whether a consumer is enabled (taking the consumer hierarchy into consideration)\n within the Performance Schema.\n \n Parameters\n \n in_consumer VARCHAR(64): \n The name of the consumer to check.\n \n Returns\n \n ENUM(''YES'', ''NO'')\n \n Example\n \n mysql> SELECT sys.ps_is_consumer_enabled(''events_stages_history'');\n +-----------------------------------------------------+\n | sys.ps_is_consumer_enabled(''events_stages_history'') |\n +-----------------------------------------------------+\n | NO                                                  |\n +-----------------------------------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_is_instrument_default_enabled', 'def', 'sys', 'ps_is_instrument_default_enabled', 'FUNCTION', 'enum', 3, 9, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'enum(''YES'',''NO'')', 'SQL', 'BEGIN DECLARE v_enabled ENUM(''YES'', ''NO'');  SET v_enabled = IF(in_instrument LIKE ''wait/io/file/%'' OR in_instrument LIKE ''wait/io/table/%'' OR in_instrument LIKE ''statement/%'' OR in_instrument LIKE ''memory/performance_schema/%'' OR in_instrument IN (''wait/lock/table/sql/handler'', ''idle'')  OR in_instrument LIKE ''stage/innodb/%'' OR in_instrument = ''stage/sql/copy to tmp table''  , ''YES'', ''NO'' );  RETURN v_enabled; END', NULL, NULL, 'SQL', 'YES', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Returns whether an instrument is enabled by default in this version of MySQL.\n \n Parameters\n \n in_instrument VARCHAR(128): \n The instrument to check.\n \n Returns\n \n ENUM(''YES'', ''NO'')\n \n Example\n \n mysql> SELECT sys.ps_is_instrument_default_enabled(''statement/sql/select'');\n +--------------------------------------------------------------+\n | sys.ps_is_instrument_default_enabled(''statement/sql/select'') |\n +--------------------------------------------------------------+\n | YES                                                          |\n +--------------------------------------------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_is_instrument_default_timed', 'def', 'sys', 'ps_is_instrument_default_timed', 'FUNCTION', 'enum', 3, 9, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'enum(''YES'',''NO'')', 'SQL', 'BEGIN DECLARE v_timed ENUM(''YES'', ''NO'');  SET v_timed = IF(in_instrument LIKE ''wait/io/file/%'' OR in_instrument LIKE ''wait/io/table/%'' OR in_instrument LIKE ''statement/%'' OR in_instrument IN (''wait/lock/table/sql/handler'', ''idle'')  OR in_instrument LIKE ''stage/innodb/%'' OR in_instrument = ''stage/sql/copy to tmp table''  , ''YES'', ''NO'' );  RETURN v_timed; END', NULL, NULL, 'SQL', 'YES', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Returns whether an instrument is timed by default in this version of MySQL.\n \n Parameters\n \n in_instrument VARCHAR(128): \n The instrument to check.\n \n Returns\n \n ENUM(''YES'', ''NO'')\n \n Example\n \n mysql> SELECT sys.ps_is_instrument_default_timed(''statement/sql/select'');\n +------------------------------------------------------------+\n | sys.ps_is_instrument_default_timed(''statement/sql/select'') |\n +------------------------------------------------------------+\n | YES                                                        |\n +------------------------------------------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_is_thread_instrumented', 'def', 'sys', 'ps_is_thread_instrumented', 'FUNCTION', 'enum', 7, 21, NULL, NULL, NULL, 'utf8', 'utf8_general_ci', 'enum(''YES'',''NO'',''UNKNOWN'')', 'SQL', 'BEGIN DECLARE v_enabled ENUM(''YES'', ''NO'', ''UNKNOWN'');  IF (in_connection_id IS NULL) THEN RETURN NULL; END IF;  SELECT INSTRUMENTED INTO v_enabled FROM performance_schema.threads  WHERE PROCESSLIST_ID = in_connection_id;  IF (v_enabled IS NULL) THEN RETURN ''UNKNOWN''; ELSE RETURN v_enabled; END IF; END', NULL, NULL, 'SQL', 'NO', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:43', '2017-05-14 21:04:43', '', '\n Description\n \n Checks whether the provided connection id is instrumented within Performance Schema.\n \n Parameters\n \n in_connection_id (BIGINT UNSIGNED):\n The id of the connection to check.\n \n Returns\n \n ENUM(''YES'', ''NO'', ''UNKNOWN'')\n \n Example\n \n mysql> SELECT sys.ps_is_thread_instrumented(CONNECTION_ID());\n +------------------------------------------------+\n | sys.ps_is_thread_instrumented(CONNECTION_ID()) |\n +------------------------------------------------+\n | YES                                            |\n +------------------------------------------------+\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_disable_background_threads', 'def', 'sys', 'ps_setup_disable_background_threads', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.threads SET instrumented = ''NO'' WHERE type = ''BACKGROUND'';  SELECT CONCAT(''Disabled '', @rows := ROW_COUNT(), '' background thread'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Disable all background thread instrumentation within Performance Schema.\n \n Parameters\n \n None.\n \n Example\n \n mysql> CALL sys.ps_setup_disable_background_threads();\n +--------------------------------+\n | summary                        |\n +--------------------------------+\n | Disabled 18 background threads |\n +--------------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_disable_consumer', 'def', 'sys', 'ps_setup_disable_consumer', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.setup_consumers SET enabled = ''NO'' WHERE name LIKE CONCAT(''%'', consumer, ''%'');  SELECT CONCAT(''Disabled '', @rows := ROW_COUNT(), '' consumer'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Disables consumers within Performance Schema \n matching the input pattern.\n \n Parameters\n \n consumer (VARCHAR(128)):\n A LIKE pattern match (using "%consumer%") of consumers to disable\n \n Example\n \n To disable all consumers:\n \n mysql> CALL sys.ps_setup_disable_consumer('''');\n +--------------------------+\n | summary                  |\n +--------------------------+\n | Disabled 15 consumers    |\n +--------------------------+\n 1 row in set (0.02 sec)\n \n To disable just the event_stage consumers:\n \n mysql> CALL sys.ps_setup_disable_comsumers(''stage'');\n +------------------------+\n | summary                |\n +------------------------+\n | Disabled 3 consumers   |\n +------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_disable_instrument', 'def', 'sys', 'ps_setup_disable_instrument', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.setup_instruments SET enabled = ''NO'', timed = ''NO'' WHERE name LIKE CONCAT(''%'', in_pattern, ''%'');  SELECT CONCAT(''Disabled '', @rows := ROW_COUNT(), '' instrument'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Disables instruments within Performance Schema \n matching the input pattern.\n \n Parameters\n \n in_pattern (VARCHAR(128)):\n A LIKE pattern match (using "%in_pattern%") of events to disable\n \n Example\n \n To disable all mutex instruments:\n \n mysql> CALL sys.ps_setup_disable_instrument(''wait/synch/mutex'');\n +--------------------------+\n | summary                  |\n +--------------------------+\n | Disabled 155 instruments |\n +--------------------------+\n 1 row in set (0.02 sec)\n \n To disable just a specific TCP/IP based network IO instrument:\n \n mysql> CALL sys.ps_setup_disable_instrument(''wait/io/socket/sql/server_tcpip_socket'');\n +------------------------+\n | summary                |\n +------------------------+\n | Disabled 1 instruments |\n +------------------------+\n 1 row in set (0.00 sec)\n \n To disable all instruments:\n \n mysql> CALL sys.ps_setup_disable_instrument('''');\n +--------------------------+\n | summary                  |\n +--------------------------+\n | Disabled 547 instruments |\n +--------------------------+\n 1 row in set (0.01 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_disable_thread', 'def', 'sys', 'ps_setup_disable_thread', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.threads SET instrumented = ''NO'' WHERE processlist_id = in_connection_id;  SELECT CONCAT(''Disabled '', @rows := ROW_COUNT(), '' thread'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Disable the given connection/thread in Performance Schema.\n \n Parameters\n \n in_connection_id (BIGINT):\n The connection ID (PROCESSLIST_ID from performance_schema.threads\n or the ID shown within SHOW PROCESSLIST)\n \n Example\n \n mysql> CALL sys.ps_setup_disable_thread(3);\n +-------------------+\n | summary           |\n +-------------------+\n | Disabled 1 thread |\n +-------------------+\n 1 row in set (0.01 sec)\n \n To disable the current connection:\n \n mysql> CALL sys.ps_setup_disable_thread(CONNECTION_ID());\n +-------------------+\n | summary           |\n +-------------------+\n | Disabled 1 thread |\n +-------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_enable_background_threads', 'def', 'sys', 'ps_setup_enable_background_threads', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.threads SET instrumented = ''YES'' WHERE type = ''BACKGROUND'';  SELECT CONCAT(''Enabled '', @rows := ROW_COUNT(), '' background thread'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Enable all background thread instrumentation within Performance Schema.\n \n Parameters\n \n None.\n \n Example\n \n mysql> CALL sys.ps_setup_enable_background_threads();\n +-------------------------------+\n | summary                       |\n +-------------------------------+\n | Enabled 18 background threads |\n +-------------------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_enable_consumer', 'def', 'sys', 'ps_setup_enable_consumer', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.setup_consumers SET enabled = ''YES'' WHERE name LIKE CONCAT(''%'', consumer, ''%'');  SELECT CONCAT(''Enabled '', @rows := ROW_COUNT(), '' consumer'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Enables consumers within Performance Schema \n matching the input pattern.\n \n Parameters\n \n consumer (VARCHAR(128)):\n A LIKE pattern match (using "%consumer%") of consumers to enable\n \n Example\n \n To enable all consumers:\n \n mysql> CALL sys.ps_setup_enable_consumer('''');\n +-------------------------+\n | summary                 |\n +-------------------------+\n | Enabled 10 consumers    |\n +-------------------------+\n 1 row in set (0.02 sec)\n \n Query OK, 0 rows affected (0.02 sec)\n \n To enable just "waits" consumers:\n \n mysql> CALL sys.ps_setup_enable_consumer(''waits'');\n +-----------------------+\n | summary               |\n +-----------------------+\n | Enabled 3 consumers   |\n +-----------------------+\n 1 row in set (0.00 sec)\n \n Query OK, 0 rows affected (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_enable_instrument', 'def', 'sys', 'ps_setup_enable_instrument', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.setup_instruments SET enabled = ''YES'', timed = ''YES'' WHERE name LIKE CONCAT(''%'', in_pattern, ''%'');  SELECT CONCAT(''Enabled '', @rows := ROW_COUNT(), '' instrument'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Enables instruments within Performance Schema \n matching the input pattern.\n \n Parameters\n \n in_pattern (VARCHAR(128)):\n A LIKE pattern match (using "%in_pattern%") of events to enable\n \n Example\n \n To enable all mutex instruments:\n \n mysql> CALL sys.ps_setup_enable_instrument(''wait/synch/mutex'');\n +-------------------------+\n | summary                 |\n +-------------------------+\n | Enabled 155 instruments |\n +-------------------------+\n 1 row in set (0.02 sec)\n \n Query OK, 0 rows affected (0.02 sec)\n \n To enable just a specific TCP/IP based network IO instrument:\n \n mysql> CALL sys.ps_setup_enable_instrument(''wait/io/socket/sql/server_tcpip_socket'');\n +-----------------------+\n | summary               |\n +-----------------------+\n | Enabled 1 instruments |\n +-----------------------+\n 1 row in set (0.00 sec)\n \n Query OK, 0 rows affected (0.00 sec)\n \n To enable all instruments:\n \n mysql> CALL sys.ps_setup_enable_instrument('''');\n +-------------------------+\n | summary                 |\n +-------------------------+\n | Enabled 547 instruments |\n +-------------------------+\n 1 row in set (0.01 sec)\n \n Query OK, 0 rows affected (0.01 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_enable_thread', 'def', 'sys', 'ps_setup_enable_thread', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN UPDATE performance_schema.threads SET instrumented = ''YES'' WHERE processlist_id = in_connection_id;  SELECT CONCAT(''Enabled '', @rows := ROW_COUNT(), '' thread'', IF(@rows != 1, ''s'', '''')) AS summary; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Enable the given connection/thread in Performance Schema.\n \n Parameters\n \n in_connection_id (BIGINT):\n The connection ID (PROCESSLIST_ID from performance_schema.threads\n or the ID shown within SHOW PROCESSLIST)\n \n Example\n \n mysql> CALL sys.ps_setup_enable_thread(3);\n +------------------+\n | summary          |\n +------------------+\n | Enabled 1 thread |\n +------------------+\n 1 row in set (0.01 sec)\n \n To enable the current connection:\n \n mysql> CALL sys.ps_setup_enable_thread(CONNECTION_ID());\n +------------------+\n | summary          |\n +------------------+\n | Enabled 1 thread |\n +------------------+\n 1 row in set (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_reload_saved', 'def', 'sys', 'ps_setup_reload_saved', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN DECLARE v_done bool DEFAULT FALSE; DECLARE v_lock_result INT; DECLARE v_lock_used_by BIGINT; DECLARE v_signal_message TEXT; DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN SIGNAL SQLSTATE VALUE ''90001'' SET MESSAGE_TEXT = ''An error occurred, was sys.ps_setup_save() run before this procedure?''; END;  SET @log_bin := @@sql_log_bin; SET sql_log_bin = 0;  SELECT IS_USED_LOCK(''sys.ps_setup_save'') INTO v_lock_used_by;  IF (v_lock_used_by != CONNECTION_ID()) THEN SET v_signal_message = CONCAT(''The sys.ps_setup_save lock is currently owned by '', v_lock_used_by); SIGNAL SQLSTATE VALUE ''90002'' SET MESSAGE_TEXT = v_signal_message; END IF;  DELETE FROM performance_schema.setup_actors; INSERT INTO performance_schema.setup_actors SELECT * FROM tmp_setup_actors;  BEGIN DECLARE v_name varchar(64); DECLARE v_enabled enum(''YES'', ''NO''); DECLARE c_consumers CURSOR FOR SELECT NAME, ENABLED FROM tmp_setup_consumers; DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;  SET v_done = FALSE; OPEN c_consumers; c_consumers_loop: LOOP FETCH c_consumers INTO v_name, v_enabled; IF v_done THEN LEAVE c_consumers_loop; END IF;  UPDATE performance_schema.setup_consumers SET ENABLED = v_enabled WHERE NAME = v_name; END LOOP; CLOSE c_consumers; END;  UPDATE performance_schema.setup_instruments INNER JOIN tmp_setup_instruments USING (NAME) SET performance_schema.setup_instruments.ENABLED = tmp_setup_instruments.ENABLED, performance_schema.setup_instruments.TIMED   = tmp_setup_instruments.TIMED; BEGIN DECLARE v_thread_id bigint unsigned; DECLARE v_instrumented enum(''YES'', ''NO''); DECLARE c_threads CURSOR FOR SELECT THREAD_ID, INSTRUMENTED FROM tmp_threads; DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;  SET v_done = FALSE; OPEN c_threads; c_threads_loop: LOOP FETCH c_threads INTO v_thread_id, v_instrumented; IF v_done THEN LEAVE c_threads_loop; END IF;  UPDATE performance_schema.threads SET INSTRUMENTED = v_instrumented WHERE THREAD_ID = v_thread_id; END LOOP; CLOSE c_threads; END;  UPDATE performance_schema.threads SET INSTRUMENTED = IF(PROCESSLIST_USER IS NOT NULL, sys.ps_is_account_enabled(PROCESSLIST_HOST, PROCESSLIST_USER), ''YES'') WHERE THREAD_ID NOT IN (SELECT THREAD_ID FROM tmp_threads);  DROP TEMPORARY TABLE tmp_setup_actors; DROP TEMPORARY TABLE tmp_setup_consumers; DROP TEMPORARY TABLE tmp_setup_instruments; DROP TEMPORARY TABLE tmp_threads;  SELECT RELEASE_LOCK(''sys.ps_setup_save'') INTO v_lock_result;  SET sql_log_bin = @log_bin;  END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Reloads a saved Performance Schema configuration,\n so that you can alter the setup for debugging purposes, \n but restore it to a previous state.\n \n Use the companion procedure - ps_setup_save(), to \n save a configuration.\n \n Requires the SUPER privilege for "SET sql_log_bin = 0;".\n \n Parameters\n \n None.\n \n Example\n \n mysql> CALL sys.ps_setup_save();\n Query OK, 0 rows affected (0.08 sec)\n \n mysql> UPDATE performance_schema.setup_instruments SET enabled = ''YES'', timed = ''YES'';\n Query OK, 547 rows affected (0.40 sec)\n Rows matched: 784  Changed: 547  Warnings: 0\n \n /* Run some tests that need more detailed instrumentation here */\n \n mysql> CALL sys.ps_setup_reload_saved();\n Query OK, 0 rows affected (0.32 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_reset_to_default', 'def', 'sys', 'ps_setup_reset_to_default', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN SET @query = ''DELETE FROM performance_schema.setup_actors WHERE NOT (HOST = ''%'' AND USER = ''%'' AND ROLE = ''%'')'';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: setup_actors\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt;  SET @query = ''INSERT IGNORE INTO performance_schema.setup_actors VALUES (''%'', ''%'', ''%'', ''YES'', ''YES'')'';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: setup_actors\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt;  SET @query = ''UPDATE performance_schema.setup_instruments SET ENABLED = sys.ps_is_instrument_default_enabled(NAME), TIMED   = sys.ps_is_instrument_default_timed(NAME)'';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: setup_instruments\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt;  SET @query = ''UPDATE performance_schema.setup_consumers SET ENABLED = IF(NAME IN (''events_statements_current'', ''events_transactions_current'', ''global_instrumentation'', ''thread_instrumentation'', ''statements_digest''), ''YES'', ''NO'')'';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: setup_consumers\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt;  SET @query = ''DELETE FROM performance_schema.setup_objects WHERE NOT (OBJECT_TYPE IN (''EVENT'', ''FUNCTION'', ''PROCEDURE'', ''TABLE'', ''TRIGGER'') AND OBJECT_NAME = ''%''  AND (OBJECT_SCHEMA = ''mysql''              AND ENABLED = ''NO''  AND TIMED = ''NO'' ) OR (OBJECT_SCHEMA = ''performance_schema'' AND ENABLED = ''NO''  AND TIMED = ''NO'' ) OR (OBJECT_SCHEMA = ''information_schema'' AND ENABLED = ''NO''  AND TIMED = ''NO'' ) OR (OBJECT_SCHEMA = ''%''                  AND ENABLED = ''YES'' AND TIMED = ''YES''))'';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: setup_objects\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt;  SET @query = ''INSERT IGNORE INTO performance_schema.setup_objects VALUES (''EVENT''    , ''mysql''             , ''%'', ''NO'' , ''NO'' ), (''EVENT''    , ''performance_schema'', ''%'', ''NO'' , ''NO'' ), (''EVENT''    , ''information_schema'', ''%'', ''NO'' , ''NO'' ), (''EVENT''    , ''%''                 , ''%'', ''YES'', ''YES''), (''FUNCTION'' , ''mysql''             , ''%'', ''NO'' , ''NO'' ), (''FUNCTION'' , ''performance_schema'', ''%'', ''NO'' , ''NO'' ), (''FUNCTION'' , ''information_schema'', ''%'', ''NO'' , ''NO'' ), (''FUNCTION'' , ''%''                 , ''%'', ''YES'', ''YES''), (''PROCEDURE'', ''mysql''             , ''%'', ''NO'' , ''NO'' ), (''PROCEDURE'', ''performance_schema'', ''%'', ''NO'' , ''NO'' ), (''PROCEDURE'', ''information_schema'', ''%'', ''NO'' , ''NO'' ), (''PROCEDURE'', ''%''                 , ''%'', ''YES'', ''YES''), (''TABLE''    , ''mysql''             , ''%'', ''NO'' , ''NO'' ), (''TABLE''    , ''performance_schema'', ''%'', ''NO'' , ''NO'' ), (''TABLE''    , ''information_schema'', ''%'', ''NO'' , ''NO'' ), (''TABLE''    , ''%''                 , ''%'', ''YES'', ''YES''), (''TRIGGER''  , ''mysql''             , ''%'', ''NO'' , ''NO'' ), (''TRIGGER''  , ''performance_schema'', ''%'', ''NO'' , ''NO'' ), (''TRIGGER''  , ''information_schema'', ''%'', ''NO'' , ''NO'' ), (''TRIGGER''  , ''%''                 , ''%'', ''YES'', ''YES'')'';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: setup_objects\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt;  SET @query = ''UPDATE performance_schema.threads SET INSTRUMENTED = ''YES'''';  IF (in_verbose) THEN SELECT CONCAT(''Resetting: threads\n'', REPLACE(@query, ''  '', '''')) AS status; END IF;  PREPARE reset_stmt FROM @query; EXECUTE reset_stmt; DEALLOCATE PREPARE reset_stmt; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Resets the Performance Schema setup to the default settings.\n \n Parameters\n \n in_verbose (BOOLEAN):\n Whether to print each setup stage (including the SQL) whilst running.\n \n Example\n \n mysql> CALL sys.ps_setup_reset_to_default(true)\\G\n *************************** 1. row ***************************\n status: Resetting: setup_actors\n DELETE\n FROM performance_schema.setup_actors\n WHERE NOT (HOST = ''%'' AND USER = ''%'' AND ROLE = ''%'')\n 1 row in set (0.00 sec)\n \n *************************** 1. row ***************************\n status: Resetting: setup_actors\n INSERT IGNORE INTO performance_schema.setup_actors\n VALUES (''%'', ''%'', ''%'')\n 1 row in set (0.00 sec)\n ...\n \n mysql> CALL sys.ps_setup_reset_to_default(false)\\G\n Query OK, 0 rows affected (0.00 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_save', 'def', 'sys', 'ps_setup_save', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN DECLARE v_lock_result INT;  SET @log_bin := @@sql_log_bin; SET sql_log_bin = 0;  SELECT GET_LOCK(''sys.ps_setup_save'', in_timeout) INTO v_lock_result;  IF v_lock_result THEN DROP TEMPORARY TABLE IF EXISTS tmp_setup_actors; DROP TEMPORARY TABLE IF EXISTS tmp_setup_consumers; DROP TEMPORARY TABLE IF EXISTS tmp_setup_instruments; DROP TEMPORARY TABLE IF EXISTS tmp_threads;  CREATE TEMPORARY TABLE tmp_setup_actors LIKE performance_schema.setup_actors; CREATE TEMPORARY TABLE tmp_setup_consumers LIKE performance_schema.setup_consumers; CREATE TEMPORARY TABLE tmp_setup_instruments LIKE performance_schema.setup_instruments; CREATE TEMPORARY TABLE tmp_threads (THREAD_ID bigint unsigned NOT NULL PRIMARY KEY, INSTRUMENTED enum(''YES'',''NO'') NOT NULL);  INSERT INTO tmp_setup_actors SELECT * FROM performance_schema.setup_actors; INSERT INTO tmp_setup_consumers SELECT * FROM performance_schema.setup_consumers; INSERT INTO tmp_setup_instruments SELECT * FROM performance_schema.setup_instruments; INSERT INTO tmp_threads SELECT THREAD_ID, INSTRUMENTED FROM performance_schema.threads; ELSE SIGNAL SQLSTATE VALUE ''90000'' SET MESSAGE_TEXT = ''Could not lock the sys.ps_setup_save user lock, another thread has a saved configuration''; END IF;  SET sql_log_bin = @log_bin; END', NULL, NULL, 'SQL', 'NO', 'MODIFIES SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Saves the current configuration of Performance Schema, \n so that you can alter the setup for debugging purposes, \n but restore it to a previous state.\n \n Use the companion procedure - ps_setup_reload_saved(), to \n restore the saved config.\n \n The named lock "sys.ps_setup_save" is taken before the\n current configuration is saved. If the attempt to get the named\n lock times out, an error occurs.\n \n The lock is released after the settings have been restored by\n calling ps_setup_reload_saved().\n \n Requires the SUPER privilege for "SET sql_log_bin = 0;".\n \n Parameters\n \n in_timeout INT\n The timeout in seconds used when trying to obtain the lock.\n A negative timeout means infinite timeout.\n \n Example\n \n mysql> CALL sys.ps_setup_save(-1);\n Query OK, 0 rows affected (0.08 sec)\n \n mysql> UPDATE performance_schema.setup_instruments \n ->    SET enabled = ''YES'', timed = ''YES'';\n Query OK, 547 rows affected (0.40 sec)\n Rows matched: 784  Changed: 547  Warnings: 0\n \n /* Run some tests that need more detailed instrumentation here */\n \n mysql> CALL sys.ps_setup_reload_saved();\n Query OK, 0 rows affected (0.32 sec)\n ', 'mysql.sys@localhost', 'utf8', 'utf8_general_ci', 'utf8_general_ci'),
('ps_setup_show_disabled', 'def', 'sys', 'ps_setup_show_disabled', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN SELECT @@performance_schema AS performance_schema_enabled;   SELECT CONCAT('''''', user, ''''@'''', host, '''''') AS disabled_users FROM performance_schema.setup_actors WHERE enabled = ''NO'' ORDER BY disabled_users;   SELECT object_type, CONCAT(object_schema, ''.'', object_name) AS objects, enabled, timed FROM performance_schema.setup_objects WHERE enabled = ''NO'' ORDER BY object_type, objects;  SELECT name AS disabled_consumers FROM performance_schema.setup_consumers WHERE enabled = ''NO'' ORDER BY disabled_consumers;  IF (in_show_threads) THEN SELECT IF(name = ''thread/sql/one_connection'',  CONCAT(processlist_user, ''@'', processlist_host),  REPLACE(name, ''thread/'', '''')) AS disabled_threads, TYPE AS thread_type FROM performance_schema.threads WHERE INSTRUMENTED = ''NO'' ORDER BY disabled_threads; END IF;  IF (in_show_instruments) THEN SELECT name AS disabled_instruments, timed FROM performance_schema.setup_instruments WHERE enabled = ''NO'' ORDER BY disabled_instruments; END IF; END', NULL, NULL, 'SQL', 'NO', 'READS SQL DATA', NULL, 'INVOKER', '2017-05-14 21:04:48', '2017-05-14 21:04:48', '', '\n Description\n \n Shows all currently disable Performance Schema configuration.\n \n Disabled users is only available for MySQL 5.7.6 and later.\n In earlier versions it was only possible to enable users.\n \n Parameters\n \n in_show_instruments (BOOLEAN):\n Whether to print disabled instruments (can print many items)\n \n in_show_threads (BOOLEAN):\n Whether to print disabled threads\n \n Example\n \n mysql> CALL sys.ps_setup_show_disabled(TRUE, TRUE);\n +----------------------------+\n | performance_schema_enabled |\n +----------------------------+\n |                          1 |\n +----------------------------+\n 1 row in set (0.00 sec)\n \n +--------------------+\n | disabled_users     |\n +--------------------+\n | '